('Tug','v. t.','To pull; to pluck.'),('Tug','v. i.','To pull with great effort; to strain in labor; as, to tug\n   at the oar; to tug against the stream.'),('Tug','v. i.','To labor; to strive; to struggle.'),('Tug','n.','A pull with the utmost effort, as in the athletic contest\n   called tug of war; a supreme effort.'),('Tug','n.','A sort of vehicle, used for conveying timber and heavy\n   articles.'),('Tug','n.','A small, powerful steamboat used to tow vessels; -- called\n   also steam tug, tugboat, and towboat.'),('Tug','n.','A trace, or drawing strap, of a harness.'),('Tug','n.','An iron hook of a hoisting tub, to which a tackle is affixed.'),('Tugan','n.','Same as Tucan.'),('Tugboat','n.','See Tug, n., 3.'),('Tugger','n.','One who tugs.'),('Tuggingly','adv.','In a tugging manner; with laborious pulling.'),('Tulle','n.','In plate armor, a suspended plate in from of the thigh. See\n   Illust. of Tasses.'),('Tuition','n.','Superintending care over a young person; the particular\n   watch and care of a tutor or guardian over his pupil or ward;\n   guardianship.'),('Tuition','n.','Especially, the act, art, or business of teaching;\n   instruction; as, children are sent to school for tuition; his tuition\n   was thorough.'),('Tuition','n.','The money paid for instruction; the price or payment for\n   instruction.'),('Tuitionary','a.','Of or pertaining to tuition.'),('Tuko-tuko','n.','A burrowing South American rodent (Ctenomys\n   Braziliensis). It has small eyes and ears and a short tail. It\n   resembles the pocket gopher in size, form, and habits, but is more\n   nearly allied to the porcupines.'),('Tula metal','','An alloy of silver, copper, and lead made at Tula in\n   Russia.'),('Tule','n.','A large bulrush (Scirpus lacustris, and S. Tatora) growing\n   abundantly on overflowed land in California and elsewhere.'),('Tulip','n.','Any plant of the liliaceous genus Tulipa. Many varieties are\n   cultivated for their beautiful, often variegated flowers.'),('Tulip-eared','a.','Having erect, pointed ears; prick-eared; -- said of\n   certain dogs.'),('Tulipist','n.','A person who is especially devoted to the cultivation of\n   tulips.'),('Tulipomania','n.','A violent passion for the acquisition or cultivation\n   of tulips; -- a word said by Beckman to have been coined by Menage.'),('Tulipomaniac','n.','One who is affected with tulipomania.'),('Tulip-shell','n.','A large, handsomely colored, marine univalve shell\n   (Fasciolaria tulipa) native of the Southern United States. The name is\n   sometimes applied also to other species of Fasciolaria.'),('Tulipwood','n.','The beautiful rose-colored striped wood of a Brazilian\n   tree (Physocalymna floribunda), much used by cabinetmakers for\n   inlaying.'),('Tull','v. t.','To allure; to tole.'),('Tulle','n.','A kind of silk lace or light netting, used for veils, etc.'),('Tullian','a.','Belonging to, or in the style of, Tully (Marcus Tullius\n   Cicero).'),('Tullibee','n.','A whitefish (Coregonus tullibee) found in the Great Lakes\n   of North America; -- called also mongrel whitefish.'),('Tumbled','imp. & p. p.','of Tumble'),('Tumbling','p. pr. & vb. n.','of Tumble'),('Tumble','v. i.','To roll over, or to and fro; to throw one\'s self about;\n   as, a person on pain tumbles and tosses.'),('Tumble','v. i.','To roll down; to fall suddenly and violently; to be\n   precipitated; as, to tumble from a scaffold.'),('Tumble','v. i.','To play tricks by various movements and contortions of\n   the body; to perform the feats of an acrobat.'),('Tumble','v. t.','To turn over; to turn or throw about, as for examination\n   or search; to roll or move in a rough, coarse, or unceremonious manner;\n   to throw down or headlong; to precipitate; -- sometimes with over,\n   about, etc.; as, to tumble books or papers.'),('Tumble','v. t.','To disturb; to rumple; as, to tumble a bed.'),('Tumble','n.','Act of tumbling, or rolling over; a fall.'),('Tumblebug','n.','See Tumbledung.'),('Tumble-down','a.','Ready to fall; dilapidated; ruinous; as, a tumble-down\n   house.'),('Tumbledung','n.','Any one of numerous species of scaraboid beetles\n   belonging to Scarabaeus, Copris, Phanaeus, and allied genera. The\n   female lays her eggs in a globular mass of dung which she rolls by\n   means of her hind legs to a burrow excavated in the earth in which she\n   buries it.'),('Tumbler','n.','One who tumbles; one who plays tricks by various motions\n   of the body; an acrobat.'),('Tumbler','n.','A movable obstruction in a lock, consisting of a lever,\n   latch, wheel, slide, or the like, which must be adjusted to a\n   particular position by a key or other means before the bolt can be\n   thrown in locking or unlocking.'),('Tumbler','n.','A piece attached to, or forming part of, the hammer of a\n   gunlock, upon which the mainspring acts and in which are the notches\n   for sear point to enter.'),('Tumbler','n.','A drinking glass, without a foot or stem; -- so called\n   because originally it had a pointed or convex base, and could not be\n   set down with any liquor in it, thus compelling the drinker to finish\n   his measure.'),('Tumbler','n.','A variety of the domestic pigeon remarkable for its habit\n   of tumbling, or turning somersaults, during its flight.'),('Tumbler','n.','A breed of dogs that tumble when pursuing game. They were\n   formerly used in hunting rabbits.'),('Tumbler','n.','A kind of cart; a tumbrel.'),('Tumblerfuls','pl. ','of Tumblerful'),('Tumblerful','n.','As much as a tumbler will hold; enough to fill a\n   tumbler.'),('Tumbleweed','n.','Any plant which habitually breaks away from its roots\n   in the autumn, and is driven by the wind, as a light, rolling mass,\n   over the fields and prairies; as witch grass, wild indigo, Amarantus\n   albus, etc.'),('Tumbling','','a. & vb. n. from Tumble, v.'),('Tumbrel','n.','Alt. of Tumbril'),('Tumbril','n.','A cucking stool for the punishment of scolds.'),('Tumbril','n.','A rough cart.'),('Tumbril','n.','A cart or carriage with two wheels, which accompanies\n   troops or artillery, to convey the tools of pioneers, cartridges, and\n   the like.'),('Tumbril','n.','A kind of basket or cage of osiers, willows, or the like,\n   to hold hay and other food for sheep.'),('Tumefaction','n.','The act or process of tumefying, swelling, or rising\n   into a tumor; a swelling.'),('Tumefied','imp. & p. p.','of Tumefy'),('Tumefying','p. pr. & vb. n.','of Tumefy'),('Tumefy','v. t.','To swell; to cause to swell, or puff up.'),('Tumefy','v. i.','To rise in a tumor; to swell.'),('Tumid','a.','Swelled, enlarged, or distended; as, a tumid leg; tumid\n   flesh.'),('Tumid','a.','Rising above the level; protuberant.'),('Tumid','a.','Swelling in sound or sense; pompous; puffy; inflated;\n   bombastic; falsely sublime; turgid; as, a tumid expression; a tumid\n   style.'),('Tumidity','n.','The quality or state of being tumid.'),('Tummals','n.','A great quantity or heap.'),('Tumor','n.','A morbid swelling, prominence, or growth, on any part of the\n   body; especially, a growth produced by deposition of new tissue; a\n   neoplasm.'),('Tumor','n.','Affected pomp; bombast; swelling words or expressions; false\n   magnificence or sublimity.'),('Tumored','a.','Distended; swelled.'),('Tumorous','a.','Swelling; protuberant.'),('Tumorous','a.','Inflated; bombastic.'),('Tump','n.','A little hillock; a knoll.'),('Tumped','imp. & p. p.','of Tump'),('Tumping','p. pr. & vb. n.','of Tump'),('Tump','v. t.','To form a mass of earth or a hillock about; as, to tump\n   teasel.'),('Tump','v. t.','To draw or drag, as a deer or other animal after it has\n   been killed.'),('Tumpline','n.','A strap placed across a man\'s forehead to assist him in\n   carrying a pack on his back.'),('Tum-tum','n.','A dish made in the West Indies by beating boiled plantain\n   quite soft in a wooden mortar.'),('Tumular','a.','Consisting in a heap; formed or being in a heap or\n   hillock.'),('Tumulate','v. t.','To cover, as a corpse, with a mound or tomb; to bury.'),('Tumulate','v. i.','To swell.'),('Tumulose','a.','Tumulous.'),('Tumulosity','n.','The quality or state of being tumulous; hilliness.'),('Tumulous','a.','Full of small hills or mounds; hilly; tumulose.'),('Tumult','n.','The commotion or agitation of a multitude, usually\n   accompanied with great noise, uproar, and confusion of voices;\n   hurly-burly; noisy confusion.'),('Tumult','n.','Violent commotion or agitation, with confusion of sounds;\n   as, the tumult of the elements.'),('Tumult','n.','Irregular or confused motion; agitation; high excitement;\n   as, the tumult of the spirits or passions.'),('Tumult','v. i.','To make a tumult; to be in great commotion.'),('Tumulter','n.','A maker of tumults.'),('Tumultuarily','adv.','In a tumultuary manner.'),('Tumultuariness','n.','The quality or state of being tumultuary.'),('Tumultuary','a.','Attended by, or producing, a tumult; disorderly;\n   promiscuous; confused; tumultuous.'),('Tumultuary','a.','Restless; agitated; unquiet.'),('Tumultuate','v. i.','To make a tumult.'),('Tumultuation','n.','Irregular or disorderly movement; commotion; as, the\n   tumultuation of the parts of a fluid.'),('Tumultuous','a.','Full of tumult; characterized by tumult; disorderly;\n   turbulent.'),('Tumultuous','a.','Conducted with disorder; noisy; confused; boisterous;\n   disorderly; as, a tumultuous assembly or meeting.'),('Tumultuous','a.','Agitated, as with conflicting passions; disturbed.'),('Tumultuous','a.','Turbulent; violent; as, a tumultuous speech.'),('Tumuli','pl. ','of Tumulus'),('Tumulus','n.','An artificial hillock, especially one raised over a grave,\n   particularly over the graves of persons buried in ancient times; a\n   barrow.'),('Tun','n.','A large cask; an oblong vessel bulging in the middle, like a\n   pipe or puncheon, and girt with hoops; a wine cask.'),('Tun','n.','A fermenting vat.'),('Tun','n.','A certain measure for liquids, as for wine, equal to two\n   pipes, four hogsheads, or 252 gallons. In different countries, the tun\n   differs in quantity.'),('Tun','n.','A weight of 2,240 pounds. See Ton.'),('Tun','n.','An indefinite large quantity.'),('Tun','n.','A drunkard; -- so called humorously, or in contempt.'),('Tun','n.','Any shell belonging to Dolium and allied genera; -- called\n   also tun-shell.'),('Tunned','imp. & p. p.','of Tun'),('Tunning','p. pr. & vb. n.','of Tun'),('Tun','v. i.','To put into tuns, or casks.'),('Tuna','n.','The Opuntia Tuna. See Prickly pear, under Prickly.'),('Tuna','n.','The tunny.'),('Tuna','n.','The bonito, 2.'),('Tunable','a.','Capable of being tuned, or made harmonious; hence,\n   harmonious; musical; tuneful.'),('Tun-bellied','a.','Having a large, protuberant belly, or one shaped like\n   a tun; pot-bellied.'),('Tun-dish','n.','A tunnel.'),('Tundra','n.','A rolling, marshy, mossy plain of Northern Siberia.'),('Tune','n.','A sound; a note; a tone.'),('Tune','n.','A rhythmical, melodious, symmetrical series of tones for one\n   voice or instrument, or for any number of voices or instruments in\n   unison, or two or more such series forming parts in harmony; a melody;\n   an air; as, a merry tune; a mournful tune; a slow tune; a psalm tune.\n   See Air.'),('Tune','n.','The state of giving the proper, sound or sounds; just\n   intonation; harmonious accordance; pitch of the voice or an instrument;\n   adjustment of the parts of an instrument so as to harmonize with itself\n   or with others; as, the piano, or the organ, is not in tune.'),('Tune','n.','Order; harmony; concord; fit disposition, temper, or humor;\n   right mood.'),('Tuned','imp. & p. p.','of Tune'),('Tuning','p. pr. & vb. n.','of Tune'),('Tune','v. t.','To put into a state adapted to produce the proper sounds;\n   to harmonize, to cause to be in tune; to correct the tone of; as, to\n   tune a piano or a violin.'),('Tune','v. t.','To give tone to; to attune; to adapt in style of music; to\n   make harmonious.'),('Tune','v. t.','To sing with melody or harmony.'),('Tune','v. t.','To put into a proper state or disposition.'),('Tune','v. i.','To form one sound to another; to form accordant musical\n   sounds.'),('Tune','v. i.','To utter inarticulate harmony with the voice; to sing\n   without pronouncing words; to hum.'),('Tuneful','a.','Harmonious; melodious; musical; as, tuneful notes.'),('Tuneless','a.','Without tune; inharmonious; unmusical.'),('Tuneless','a.','Not employed in making music; as, tuneless harps.'),('Tuneless','a.','Not expressed in music or poetry; unsung.'),('Tuner','n.','One who tunes; especially, one whose occupation is to tune\n   musical instruments.'),('Tun-great','a.','Having the circumference of a tun.'),('Tungstate','n.','A salt of tungstic acid; a wolframate.'),('Tungsten','n.','A rare element of the chromium group found in certain\n   minerals, as wolfram and scheelite, and isolated as a heavy steel-gray\n   metal which is very hard and infusible. It has both acid and basic\n   properties. When alloyed in small quantities with steel, it greatly\n   increases its hardness. Symbol W (Wolframium). Atomic weight, 183.6.\n   Specific gravity, 18.'),('Tungsten','n.','Scheelite, or calcium tungstate.'),('Tungstenic','a.','Of or pertaining to tungsten; containing tungsten; as,\n   tungstenic ores.'),('Tungstic','a.','Of or pertaining to tungsten; derived from, or\n   resembling, tungsten; wolframic; as, tungstic oxide.'),('Tungstite','n.','The oxide of tungsten, a yellow mineral occurring in a\n   pulverulent form. It is often associated with wolfram.'),('Tunguses','n. pl.','A group of roving Turanian tribes occupying Eastern\n   Siberia and the Amoor valley. They resemble the Mongols.'),('Tungusic','a.','Of or pertaining to the Tunguses; as, the Tungusic\n   dialects.'),('Tunhoof','n.','Ground ivy; alehoof.'),('Tunic','n.','An under-garment worn by the ancient Romans of both sexes.\n   It was made with or without sleeves, reached to or below the knees, and\n   was confined at the waist by a girdle.'),('Tunic','n.','Any similar garment worm by ancient or Oriental peoples;\n   also, a common name for various styles of loose-fitting under-garments\n   and over-garments worn in modern times by Europeans and others.'),('Tunic','n.','Same as Tunicle.'),('Tunic','n.','A membrane, or layer of tissue, especially when enveloping\n   an organ or part, as the eye.'),('Tunic','n.','A natural covering; an integument; as, the tunic of a seed.'),('Tunic','n.','See Mantle, n., 3 (a).'),('Tunicaries','pl. ','of Tunicary'),('Tunicary','n.','One of the Tunicata.'),('Tunicata','n. pl.','A grand division of the animal kingdom, intermediate,\n   in some respects, between the invertebrates and vertebrates, and by\n   some writers united with the latter. They were formerly classed with\n   acephalous mollusks. The body is usually covered with a firm external\n   tunic, consisting in part of cellulose, and having two openings, one\n   for the entrance and one for the exit of water. The pharynx is usually\n   dilated in the form of a sac, pierced by several series of ciliated\n   slits, and serves as a gill.'),('Tunicate','a.','Alt. of Tunicated'),('Tunicated','a.','Covered with a tunic; covered or coated with layers; as,\n   a tunicated bulb.'),('Tunicated','a.','Having a tunic, or mantle; of or pertaining to the\n   Tunicata.'),('Tunicated','a.','Having each joint buried in the preceding funnel-shaped\n   one, as in certain antennae of insects.'),('Tunicate','n.','One of the Tunicata.'),('Tunicin','n.','Animal cellulose; a substance present in the mantle, or\n   tunic, of the Tunicates, which resembles, or is identical with, the\n   cellulose of the vegetable kingdom.'),('Tunicle','n.','A slight natural covering; an integument.'),('Tunicle','n.','A short, close-fitting vestment worn by bishops under the\n   dalmatic, and by subdeacons.'),('Tuning','','a. & n. from Tune, v.'),('Tunk','n.','A sharp blow; a thump.'),('Tunker','n.','Same as Dunker.'),('Tunnage','n.','See Tonnage.'),('Tunnel','n. .','A vessel with a broad mouth at one end, a pipe or tube at\n   the other, for conveying liquor, fluids, etc., into casks, bottles, or\n   other vessels; a funnel.'),('Tunnel','n. .','The opening of a chimney for the passage of smoke; a\n   flue; a funnel.'),('Tunnel','n. .','An artificial passage or archway for conducting canals or\n   railroads under elevated ground, for the formation of roads under\n   rivers or canals, and the construction of sewers, drains, and the like.'),('Tunnel','n. .','A level passage driven across the measures, or at right\n   angles to veins which it is desired to reach; -- distinguished from the\n   drift, or gangway, which is led along the vein when reached by the\n   tunnel.'),('Tunneled','imp. & p. p.','of Tunnel'),('Tunnelled','','of Tunnel'),('Tunneling','p. pr. & vb. n.','of Tunnel'),('Tunnelling','','of Tunnel'),('Tunnel','v. t.','To form into a tunnel, or funnel, or to form like a\n   tunnel; as, to tunnel fibrous plants into nests.'),('Tunnel','v. t.','To catch in a tunnel net.'),('Tunnel','v. t.','To make an opening, or a passageway, through or under;\n   as, to tunnel a mountain; to tunnel a river.'),('Tunnies','pl. ','of Tunny'),('Tunny','n.','Any one of several species of large oceanic fishes belonging\n   to the Mackerel family, especially the common or great tunny (Orcynus /\n   Albacora thynnus) native of the Mediterranean Sea and the Atlantic\n   Ocean. It sometimes weighs a thousand pounds or more, and is\n   extensively caught in the Mediterranean. On the American coast it is\n   called horse mackerel. See Illust. of Horse mackerel, under Horse.'),('Tup','v. t. & i.','To butt, as a ram does.'),('Tup','v. t. & i.','To cover; -- said of a ram.'),('Tup','n.','A ram.'),('Tupal','n.','Any one of the tupaiids.'),('Tupaiid','n.','Any one of several species of East Indian and Asiatic\n   insectivores of the family Tupaiidae, somewhat resembling squirrels in\n   size and arboreal habits. The nose is long and pointed.'),('Tupelo','n.','A North American tree (Nyssa multiflora) of the Dogwood\n   family, having brilliant, glossy foliage and acid red berries. The wood\n   is crossgrained and very difficult to split. Called also black gum,\n   sour gum, and pepperidge.'),('Tupmen','pl. ','of Tupman'),('Tupman','n.','A man who breeds, or deals in tups.'),('Tur','n.','The urus.'),('Turacin','n.','A red or crimson pigment obtained from certain feathers of\n   several species of turacou; whence the name. It contains nearly six per\n   cent of copper.'),('Turacou','n.','Any one of several species of plantain eaters of the genus\n   Turacus, native of Africa. They are remarkable for the peculiar green\n   and red pigments found in their feathers.'),('Turacoverdin','n.','A green pigment found in the feathers of the turacou.\n   See Turacin.'),('Turanian','a.','Of, pertaining to, or designating, an extensive family of\n   languages of simple structure and low grade (called also Altaic,\n   Ural-Altaic, and Scythian), spoken in the northern parts of Europe and\n   Asia and Central Asia; of pertaining to, or designating, the people who\n   speak these languages.'),('Turanian','n.','One of the Turanians.'),('Turanians','n. pl.','An extensive division of mankind including the\n   Mongols and allied races of Asia, together with the Malays and\n   Polynesians.'),('Turanians','n. pl.','A group of races or tribes inhabiting Asia and\n   closely related to the Mongols.'),('Turatt','n.','The hare kangaroo.'),('Turban','n.','A headdress worn by men in the Levant and by most\n   Mohammedans of the male sex, consisting of a cap, and a sash, scarf, or\n   shawl, usually of cotton or linen, wound about the cap, and sometimes\n   hanging down the neck.'),('Turban','n.','A kind of headdress worn by women.'),('Turban','n.','The whole set of whorls of a spiral shell.'),('Turband','n.','A turban.'),('Turbaned','a.','Wearing a turban.'),('Turban-shell','n.','A sea urchin when deprived of its spines; --\n   popularly so called from a fancied resemblance to a turban.'),('Turbant','n.','A turban.'),('Turban-top','n.','A kind of fungus with an irregularly wrinkled, somewhat\n   globular pileus (Helvella, / Gyromitra, esculenta.).'),('Turbaries','pl. ','of Turbary'),('Turbary','n.','A right of digging turf on another man\'s land; also, the\n   ground where turf is dug.'),('Turbellaria','n. pl.','An extensive group of worms which have the body\n   covered externally with vibrating cilia. It includes the Rhabdoc/la and\n   Dendroc/la. Formerly, the nemerteans were also included in this group.'),('Turbellarian','n.','One of the Turbellaria. Also used adjectively.'),('Turbeth','n.','See Turpeth.'),('Turbid','a.','Having the lees or sediment disturbed; roiled; muddy;\n   thick; not clear; -- used of liquids of any kind; as, turbid water;\n   turbid wine.'),('Turbid','a.','Disturbed; confused; disordered.'),('Turbidity','n.','Turbidness.'),('Turbidly','adv.','In a turbid manner; with muddiness or confusion.'),('Turbidly','adv.','Proudly; haughtily.'),('Turbidness','n.','The quality or state of being turbid; muddiness;\n   foulness.'),('Turbillion','n.','A whirl; a vortex.'),('Turbinaceous','a.','Of or pertaining to peat, or turf; of the nature of\n   peat, or turf; peaty; turfy.'),('Turbinal','a.','Rolled in a spiral; scroll-like; turbinate; -- applied to\n   the thin, plicated, bony or cartilaginous plates which support the\n   olfactory and mucous membranes of the nasal chambers.'),('Turbinal','n.','A turbinal bone or cartilage.'),('Turbinate','v. i.','To revolve or spin like a top; to whirl.'),('Turbinate','a.','Alt. of Turbinated'),('Turbinated','a.','Whirling in the manner of a top.'),('Turbinated','a.','Shaped like a top, or inverted cone; narrow at the\n   base, and broad at the apex; as, a turbinated ovary, pericarp, or root.'),('Turbinated','a.','Turbinal.'),('Turbinated','a.','Spiral with the whorls decreasing rapidly from a large\n   base to a pointed apex; -- said of certain shells.'),('Turbination','n.','The act of spinning or whirling, as a top.'),('Turbine','n.','A water wheel, commonly horizontal, variously constructed,\n   but usually having a series of curved floats or buckets, against which\n   the water acts by its impulse or reaction in flowing either outward\n   from a central chamber, inward from an external casing, or from above\n   downward, etc.; -- also called turbine wheel.'),('Turbinella','n.','A genus of large marine gastropods having a thick heavy\n   shell with conspicuous folds on the columella.'),('Turbinite','n.','A petrified shell resembling the genus Turbo.'),('Turbinoid','a.','Like or pertaining to Turbo or the family Turbinidae.'),('Turbit','n.','The turbot.'),('Turbit','n.','A variety of the domestic pigeon, remarkable for its short\n   beak.'),('Turbite','n.','A fossil turbo.'),('Turbith','n.','See Turpeth.'),('Turbo','n.','Any one of numerous marine gastropods of the genus Turbo or\n   family Turbinidae, usually having a turbinate shell, pearly on the\n   inside, and a calcareous operculum.'),('Turbot','n.','A large European flounder (Rhombus maximus) highly esteemed\n   as a food fish. It often weighs from thirty to forty pounds. Its color\n   on the upper side is brownish with small roundish tubercles scattered\n   over the surface. The lower, or blind, side is white. Called also\n   bannock fluke.'),('Turbot','n.','Any one of numerous species of flounders more or less\n   related to the true turbots, as the American plaice, or summer flounder\n   (see Flounder), the halibut, and the diamond flounder (Hypsopsetta\n   guttulata) of California.'),('Turbot','n.','The filefish; -- so called in Bermuda.'),('Turbot','n.','The trigger fish.'),('Turbulence','n.','The quality or state of being turbulent; a disturbed\n   state; tumult; disorder; agitation.'),('Turbulency','n.','Turbulence.'),('Turbulent','a.','Disturbed; agitated; tumultuous; roused to violent\n   commotion; as, the turbulent ocean.'),('Turbulent','a.','Disposed to insubordination and disorder; restless;\n   unquiet; refractory; as, turbulent spirits.'),('Turbulent','a.','Producing commotion; disturbing; exciting.'),('Turbulently','adv.','In a turbulent manner.'),('Turcism','n.','A mode of speech peculiar to the Turks; a Turkish idiom or\n   expression; also, in general, a Turkish mode or custom.'),('Turcomans','pl. ','of Turcoman'),('Turcoman','n.','A member of a tribe of Turanians inhabiting a region east\n   of the Caspian Sea.'),('Turcoman','n.','A Turcoman carpet.'),('Turdiformes','n. pl.','A division of singing birds including the thrushes\n   and allied kinds.'),('Turdus','n.','A genus of singing birds including the true thrushes.'),('Tureen','n.','A large, deep vessel for holding soup, or other liquid\n   food, at the table.'),('Tureenfuls','pl. ','of Tureenful'),('Tureenful','n.','As much as a tureen can hold; enough to fill a tureen.'),('Turfs','pl. ','of Turf'),('Turves','pl. ','of Turf'),('Turf','n.','That upper stratum of earth and vegetable mold which is\n   filled with the roots of grass and other small plants, so as to adhere\n   and form a kind of mat; sward; sod.'),('Turf','n.','Peat, especially when prepared for fuel. See Peat.'),('Turf','n.','Race course; horse racing; -- preceded by the.'),('Turfed','imp. & p. p.','of Turf'),('Turfing','p. pr. & vb. n.','of Turf'),('Turf','v. t.','To cover with turf or sod; as, to turf a bank, of the\n   border of a terrace.'),('Turfen','a.','Made of turf; covered with turf.'),('Turfiness','n.','Quality or state of being turfy.'),('Turfing','n.','The act or process of providing or covering with turf.'),('Turfite','n.','A votary of the turf, or race course; hence, sometimes, a\n   blackleg.'),('Turfless','a.','Destitute of turf.'),('Turfmen','pl. ','of Turfman'),('Turfman','n.','A turfite; a votary of the turf, or race course.'),('Turfy','superl.','Abounding with turf; made of, or covered with, turf.'),('Turfy','superl.','Having the nature or appearance of turf.'),('Turfy','superl.','Of or pertaining to the turf, or horse racing.'),('Turgent','a.','Rising into a tumor, or a puffy state; swelling; tumid;\n   as, turgent humors.'),('Turgent','a.','Inflated; bombastic; turgid; pompous.'),('Turgesced','imp. & p. p.','of Turgesce'),('Turgescing','p. pr. & vb. n.','of Turgesce'),('Turgesce','v. i.','To become turgid; to swell or be inflated.'),('Turgescence','n.','Alt. of Turgescency'),('Turgescency','n.','The act of swelling, or the state of being swollen, or\n   turgescent.'),('Turgescency','n.','Empty magnificence or pompousness; inflation; bombast;\n   turgidity.'),('Turgescent','a.','Becoming turgid or inflated; swelling; growing big.'),('Turgid','a.','Distended beyond the natural state by some internal agent\n   or expansive force; swelled; swollen; bloated; inflated; tumid; --\n   especially applied to an enlarged part of the body; as, a turgid limb;\n   turgid fruit.'),('Turgid','a.','Swelling in style or language; vainly ostentatious;\n   bombastic; pompous; as, a turgid style of speaking.'),('Turgidity','n.','The quality or state of being turgid.'),('Turgidous','a.','Turgid.'),('Turiones','pl. ','of Turio'),('Turio','n.','A shoot or sprout from the ground.'),('Turiole','n.','The golden oriole.'),('Turion','n.','Same as Turio.'),('Turioniferous','a.','Producing shoots, as asparagus.'),('Turk','n.','A member of any of numerous Tartar tribes of Central Asia,\n   etc.; esp., one of the dominant race in Turkey.'),('Turk','n.','A native or inhabitant of Turkey.'),('Turk','n.','A Mohammedan; esp., one living in Turkey.'),('Turk','n.','The plum weevil. See Curculio, and Plum weevil, under Plum.'),('Turkeis','a.','Turkish.'),('Turkey','n.','An empire in the southeast of Europe and southwest of Asia.'),('Turkeys','pl. ','of Turkey'),('Turkey','n.','Any large American gallinaceous bird belonging to the genus\n   Meleagris, especially the North American wild turkey (Meleagris\n   gallopavo), and the domestic turkey, which was probably derived from\n   the Mexican wild turkey, but had been domesticated by the Indians long\n   before the discovery of America.'),('Turkeys','a.','Turkish.'),('Turkic','a.','Turkish.'),('Turkis','n.','Turquois.'),('Turkish','a.','Of or pertaining to Turkey or the Turks.'),('Turkish','n.','The language spoken by Turks, esp. that of the people of\n   Turkey.'),('Turkism','n.','Same as Turcism.'),('Turkle','n.','A turtle.'),('Turkos','pl. ','of Turko'),('Turko','n.','One of a body of native Algerian tirailleurs in the French\n   army, dressed as a Turk.'),('Turkois','n. & a.','Turquoise.'),('Turkomans','pl. ','of Turkoman'),('Turkoman','n.','Same as Turcoman.'),('Turlupin','n.','One of the precursors of the Reformation; -- a nickname\n   corresponding to Lollard, etc.'),('Turm','n.','A troop; a company.'),('Turmaline','n.','See Tourmaline.'),('Turmeric','n.','An East Indian plant of the genus Curcuma, of the Ginger\n   family.'),('Turmeric','n.','The root or rootstock of the Curcuma longa. It is\n   externally grayish, but internally of a deep, lively yellow or saffron\n   color, and has a slight aromatic smell, and a bitterish, slightly acrid\n   taste. It is used for a dye, a medicine, a condiment, and a chemical\n   test.'),('Turmeric','a.','Of or pertaining to turmeric; resembling, or obtained\n   from, turmeric; specif., designating an acid obtained by the oxidation\n   of turmerol.'),('Turmerol','n.','Turmeric oil, a brownish yellow, oily substance extracted\n   from turmeric by ligroin.'),('Turmoil','n.','Harassing labor; trouble; molestation by tumult;\n   disturbance; worrying confusion.'),('Turmoiled','imp. & p. p.','of Turmoil'),('Turmoiling','p. pr. & vb. n.','of Turmoil'),('Turmoil','v. t.','To harass with commotion; to disquiet; to worry.'),('Turmoil','v. i.','To be disquieted or confused; to be in commotion.'),('Turned','imp. & p. p.','of Turn'),('Turning','p. pr. & vb. n.','of Turn'),('Turn','v. t.','To cause to move upon a center, or as if upon a center; to\n   give circular motion to; to cause to revolve; to cause to move round,\n   either partially, wholly, or repeatedly; to make to change position so\n   as to present other sides in given directions; to make to face\n   otherwise; as, to turn a wheel or a spindle; to turn the body or the\n   head.'),('Turn','v. t.','To cause to present a different side uppermost or outmost;\n   to make the upper side the lower, or the inside to be the outside of;\n   to reverse the position of; as, to turn a box or a board; to turn a\n   coat.'),('Turn','v. t.','To give another direction, tendency, or inclination to; to\n   direct otherwise; to deflect; to incline differently; -- used both\n   literally and figuratively; as, to turn the eyes to the heavens; to\n   turn a horse from the road, or a ship from her course; to turn the\n   attention to or from something.'),('Turn','v. t.','To change from a given use or office; to divert, as to\n   another purpose or end; to transfer; to use or employ; to apply; to\n   devote.'),('Turn','v. t.','To change the form, quality, aspect, or effect of; to\n   alter; to metamorphose; to convert; to transform; -- often with to or\n   into before the word denoting the effect or product of the change; as,\n   to turn a worm into a winged insect; to turn green to blue; to turn\n   prose into verse; to turn a Whig to a Tory, or a Hindu to a Christian;\n   to turn good to evil, and the like.'),('Turn','v. t.','To form in a lathe; to shape or fashion (anything) by\n   applying a cutting tool to it while revolving; as, to turn the legs of\n   stools or tables; to turn ivory or metal.'),('Turn','v. t.','Hence, to give form to; to shape; to mold; to put in\n   proper condition; to adapt.'),('Turn','v. t.','To translate; to construe; as, to turn the Iliad.'),('Turn','v. t.','To make acid or sour; to ferment; to curdle, etc.: as, to\n   turn cider or wine; electricity turns milk quickly.'),('Turn','v. t.','To sicken; to nauseate; as, an emetic turns one\'s stomach.'),('Turn','v. i.','To move round; to have a circular motion; to revolve\n   entirely, repeatedly, or partially; to change position, so as to face\n   differently; to whirl or wheel round; as, a wheel turns on its axis; a\n   spindle turns on a pivot; a man turns on his heel.'),('Turn','v. i.','Hence, to revolve as if upon a point of support; to hinge;\n   to depend; as, the decision turns on a single fact.'),('Turn','v. i.','To result or terminate; to come about; to eventuate; to\n   issue.'),('Turn','v. i.','To be deflected; to take a different direction or\n   tendency; to be directed otherwise; to be differently applied; to be\n   transferred; as, to turn from the road.'),('Turn','v. i.','To be changed, altered, or transformed; to become\n   transmuted; also, to become by a change or changes; to grow; as, wood\n   turns to stone; water turns to ice; one color turns to another; to turn\n   Mohammedan.'),('Turn','v. i.','To undergo the process of turning on a lathe; as, ivory\n   turns well.'),('Turn','v. i.','To become acid; to sour; -- said of milk, ale, etc.'),('Turn','v. i.','To become giddy; -- said of the head or brain.'),('Turn','v. i.','To be nauseated; -- said of the stomach.'),('Turn','v. i.','To become inclined in the other direction; -- said of\n   scales.'),('Turn','v. i.','To change from ebb to flow, or from flow to ebb; -- said\n   of the tide.'),('Turn','v. i.','To bring down the feet of a child in the womb, in order to\n   facilitate delivery.'),('Turn','v. i.','To invert a type of the same thickness, as temporary\n   substitute for any sort which is exhausted.'),('Turn','n.','The act of turning; movement or motion about, or as if about,\n   a center or axis; revolution; as, the turn of a wheel.'),('Turn','n.','Change of direction, course, or tendency; different order,\n   position, or aspect of affairs; alteration; vicissitude; as, the turn\n   of the tide.'),('Turn','n.','One of the successive portions of a course, or of a series of\n   occurrences, reckoning from change to change; hence, a winding; a bend;\n   a meander.'),('Turn','n.','A circuitous walk, or a walk to and fro, ending where it\n   began; a short walk; a stroll.'),('Turn','n.','Successive course; opportunity enjoyed by alternation with\n   another or with others, or in due order; due chance; alternate or\n   incidental occasion; appropriate time.'),('Turn','n.','Incidental or opportune deed or office; occasional act of\n   kindness or malice; as, to do one an ill turn.'),('Turn','n.','Convenience; occasion; purpose; exigence; as, this will not\n   serve his turn.'),('Turn','n.','Form; cast; shape; manner; fashion; -- used in a literal or\n   figurative sense; hence, form of expression; mode of signifying; as,\n   the turn of thought; a man of a sprightly turn in conversation.'),('Turn','n.','A change of condition; especially, a sudden or recurring\n   symptom of illness, as a nervous shock, or fainting spell; as, a bad\n   turn.'),('Turn','n.','A fall off the ladder at the gallows; a hanging; -- so called\n   from the practice of causing the criminal to stand on a ladder which\n   was turned over, so throwing him off, when the signal was given.'),('Turn','n.','A round of a rope or cord in order to secure it, as about a\n   pin or a cleat.'),('Turn','n.','A pit sunk in some part of a drift.'),('Turn','n.','A court of record, held by the sheriff twice a year in every\n   hundred within his county.'),('Turn','n.','Monthly courses; menses.'),('Turn','n.','An embellishment or grace (marked thus, /), commonly\n   consisting of the principal note, or that on which the turn is made,\n   with the note above, and the semitone below, the note above being\n   sounded first, the principal note next, and the semitone below last,\n   the three being performed quickly, as a triplet preceding the marked\n   note. The turn may be inverted so as to begin with the lower note, in\n   which case the sign is either placed on end thus /, or drawn thus /.'),('Turnbroach','n.','A turnspit.'),('Turn-buckle','n.','A loop or sleeve with a screw thread at one end and a\n   swivel at the other, -- used for tightening a rod, stay, etc.'),('Turn-buckle','n.','A gravitating catch, as for fastening a shutter, the\n   end of a chain, or a hasp.'),('Turnbull\'s blue','','The double cyanide of ferrous and ferric iron, a\n   dark blue amorphous substance having a coppery luster, used in dyeing,\n   calico printing, etc. Cf. Prussian blue, under Prussian.'),('Turncoat','n.','One who forsakes his party or his principles; a renegade;\n   an apostate.'),('Turnep','n.','See Turnip.'),('Turner','n.','One who turns; especially, one whose occupation is to form\n   articles with a lathe.'),('Turner','n.','A variety of pigeon; a tumbler.'),('Turner','n.','A person who practices athletic or gymnastic exercises.'),('Turnerite','n.','A variety of monazite.'),('Turnery','n.','The art of fashioning solid bodies into cylindrical or\n   other forms by means of a lathe.'),('Turnery','n.','Things or forms made by a turner, or in the lathe.'),('Turney','n. & v.','Tourney.'),('Turnhalle','n.','A building used as a school of gymnastics.'),('Turnicimorphae','n. pl.','A division of birds including Turnix and allied\n   genera, resembling quails in appearance but differing from them\n   anatomically.'),('Turning','n.','The act of one who, or that which, turns; also, a winding;\n   a bending course; a fiexure; a meander.'),('Turning','n.','The place of a turn; an angle or corner, as of a road.'),('Turning','n.','Deviation from the way or proper course.'),('Turning','n.','Turnery, or the shaping of solid substances into various\n   by means of a lathe and cutting tools.'),('Turning','n.','The pieces, or chips, detached in the process of turning\n   from the material turned.'),('Turning','n.','A maneuver by which an enemy or a position is turned.'),('Turningness','n.','The quality of turning; instability; tergiversation.'),('Turnip','v. t.','The edible, fleshy, roundish, or somewhat conical, root\n   of a cruciferous plant (Brassica campestris, var. Napus); also, the\n   plant itself.'),('Turnip-shell','n.','Any one of several large, thick, spiral marine shells\n   belonging to Rapa and allied genera, somewhat turnip-shaped.'),('Turnix','n.','Any one of numerous species of birds belonging to Turnix or\n   Hemipodius and allied genera of the family Turnicidae. These birds\n   resemble quails and partridges in general appearance and in some of\n   their habits, but differ in important anatomical characteristics. The\n   hind toe is usually lacking. They are found in Asia, Africa, Southern\n   Europe, the East Indian Islands, and esp. in Australia and adjacent\n   islands, where they are called quails (see Quail, n., 3.). See\n   Turnicimorphae.'),('Turnkeys','pl. ','of Turnkey'),('Turnkey','n.','A person who has charge of the keys of a prison, for\n   opening and fastening the doors; a warder.'),('Turnkey','n.','An instrument with a hinged claw, -- used for extracting\n   teeth with a twist.'),('Turn-outs','pl. ','of Turn-out'),('Turn-out','n.','The act of coming forth; a leaving of houses, shops,\n   etc.; esp., a quitting of employment for the purpose of forcing\n   increase of wages; a strike; -- opposed to lockout.'),('Turn-out','n.','A short side track on a railroad, which may be occupied\n   by one train while another is passing on a main track; a shunt; a\n   siding; a switch.'),('Turn-out','n.','That which is prominently brought forward or exhibited;\n   hence, an equipage; as, a man with a showy carriage and horses is said\n   to have a fine turn-out.'),('Turn-out','n.','The aggregate number of persons who have come out, as\n   from their houses, for a special purpose.'),('Turn-out','n.','Net quantity of produce yielded.'),('Turnover','n.','The act or result of turning over; an upset; as, a bad\n   turnover in a carriage.'),('Turnover','n.','A semicircular pie or tart made by turning one half of a\n   circular crust over the other, inclosing the fruit or other materials.'),('Turnover','n.','An apprentice, in any trade, who is handed over from one\n   master to another to complete his time.'),('Turnover','a.','Admitting of being turned over; made to be turned over;\n   as, a turnover collar, etc.'),('Turnpike','n.','A frame consisting of two bars crossing each other at\n   right angles and turning on a post or pin, to hinder the passage of\n   beasts, but admitting a person to pass between the arms; a turnstile.\n   See Turnstile, 1.'),('Turnpike','n.','A gate or bar set across a road to stop carriages,\n   animals, and sometimes people, till toll is paid for keeping the road\n   in repair; a tollgate.'),('Turnpike','n.','A turnpike road.'),('Turnpike','n.','A winding stairway.'),('Turnpike','n.','A beam filled with spikes to obstruct passage; a\n   cheval-de-frise.'),('Turnpiked','imp. & p. p.','of Turnpike'),('Turnpiking','p. pr. & vb. n.','of Turnpike'),('Turnpike','v. t.','To form, as a road, in the manner of a turnpike road;\n   into a rounded form, as the path of a road.'),('Turnplate','n.','A turntable.'),('Turn-sick','a.','Giddy.'),('Turn-sick','n.','A disease with which sheep are sometimes affected; gid;\n   sturdy. See Gid.'),('Turnsole','a.','A plant of the genus Heliotropium; heliotrope; -- so\n   named because its flowers are supposed to turn toward the sun.'),('Turnsole','a.','The sunflower.'),('Turnsole','a.','A kind of spurge (Euphorbia Helioscopia).'),('Turnsole','a.','The euphorbiaceous plant Chrozophora tinctoria.'),('Turnsole','a.','Litmus.'),('Turnsole','a.','A purple dye obtained from the plant turnsole. See def. 1\n   (d).'),('Turnspit','n.','One who turns a spit; hence, a person engaged in some\n   menial office.'),('Turnspit','n.','A small breed of dogs having a long body and short\n   crooked legs. These dogs were formerly much used for turning a spit on\n   which meat was roasting.'),('Turnstile','n.','A revolving frame in a footpath, preventing the passage\n   of horses or cattle, but admitting that of persons; a turnpike. See\n   Turnpike, n., 1.'),('Turnstile','n.','A similar arrangement for registering the number of\n   persons passing through a gateway, doorway, or the like.'),('Turnstone','n.','Any species of limicoline birds of the genera Strepsilas\n   and Arenaria, allied to the plovers, especially the common American and\n   European species (Strepsilas interpres). They are so called from their\n   habit of turning up small stones in search of mollusks and other\n   aquatic animals. Called also brant bird, sand runner, sea quail, sea\n   lark, sparkback, and skirlcrake.'),('Turntable','n.','A large revolving platform, for turning railroad cars,\n   locomotives, etc., in a different direction; -- called also turnplate.'),('Turnus','n.','A common, large, handsome, American swallowtail butterfly,\n   now regarded as one of the forms of Papilio, / Jasoniades, glaucus. The\n   wings are yellow, margined and barred with black, and with an\n   orange-red spot near the posterior angle of the hind wings. Called also\n   tiger swallowtail. See Illust. under Swallowtail.'),('Turnverein','n.','A company or association of gymnasts and athletes.'),('Turnwrest','n.','Designating a cumbersome style of plow used in England,\n   esp. in Kent.'),('Turnwrest','n.','designating a kind of hillside plow.'),('Turonian','n.','One of the subdivisions into which the Upper Cretaceous\n   formation of Europe is divided.'),('Turpentine','n.','A semifluid or fluid oleoresin, primarily the exudation\n   of the terebinth, or turpentine, tree (Pistacia Terebinthus), a native\n   of the Mediterranean region. It is also obtained from many coniferous\n   trees, especially species of pine, larch, and fir.'),('Turpeth','n.','The root of Ipom/a Turpethum, a plant of Ceylon, Malabar,\n   and Australia, formerly used in medicine as a purgative; -- sometimes\n   called vegetable turpeth.'),('Turpeth','n.','A heavy yellow powder, Hg3O2SO4, which consists of a basic\n   mercuric sulphate; -- called also turpeth mineral.'),('Turpin','n.','A land tortoise.'),('Turpitude','n.','Inherent baseness or vileness of principle, words, or\n   actions; shameful wickedness; depravity.'),('Turquoise','n.','Alt. of Turquois'),('Turquois','n.','A hydrous phosphate of alumina containing a little\n   copper; calaite. It has a blue, or bluish green, color, and usually\n   occurs in reniform masses with a botryoidal surface.'),('Turquoise','a.','Having a fine light blue color, like that of choice\n   mineral turquoise.'),('Turrel','n.','A certain tool used by coopers.'),('Turret','n.','A little tower, frequently a merely ornamental structure at\n   one of the angles of a larger structure.'),('Turret','n.','A movable building, of a square form, consisting of ten or\n   even twenty stories and sometimes one hundred and twenty cubits high,\n   usually moved on wheels, and employed in approaching a fortified place,\n   for carrying soldiers, engines, ladders, casting bridges, and other\n   necessaries.'),('Turret','n.','A revolving tower constructed of thick iron plates, within\n   which cannon are mounted. Turrets are used on vessels of war and on\n   land.'),('Turret','n.','The elevated central portion of the roof of a passenger\n   car. Its sides are pierced for light and ventilation.'),('Turreted','a.','Furnished with a turret or turrets; specifically (Zool.),\n   having the whorls somewhat flattened on the upper side and often\n   ornamented by spines or tubercles; -- said of certain spiral shells.'),('Turreted','a.','Formed like a tower; as, a turreted lamp.'),('Turribant','n.','A turban.'),('Turrical','a.','Of or pertaining to a turret, or tower; resembling a\n   tower.'),('Turriculate','a.','Alt. of Turriculated'),('Turriculated','a.','Furnished with, or formed like, a small turret or\n   turrets; somewhat turreted.'),('Turrilite','n.','Any fossil ammonite of the genus Turrilites. The shell\n   forms 