oise; to make the sound of\n   a tense string pulled and suddenly let go; as, the bowstring twanged.'),('Twang','v. t.','To make to sound, as by pulling a tense string and\n   letting it go suddenly.'),('Twang','n.','A harsh, quick sound, like that made by a stretched string\n   when pulled and suddenly let go; as, the twang of a bowstring.'),('Twang','n.','An affected modulation of the voice; a kind of nasal sound.'),('Twangle','v. i. & t.','To twang.'),('Twank','v. t.','To cause to make a sharp twanging sound; to twang, or\n   twangle.'),('Twankay','n.','See Note under Tea, n., 1.'),('\'T was','','A contraction of it was.'),('Twattle','v. i.','To prate; to talk much and idly; to gabble; to chatter;\n   to twaddle; as, a twattling gossip.'),('Twattle','v. t.','To make much of, as a domestic animal; to pet.'),('Twattle','n.','Act of prating; idle talk; twaddle.'),('Twattler','n.','One who twattles; a twaddler.'),('Tway','a. & n.','Two; twain.'),('Twayblade','n.','Any one of several orchidaceous plants which have only\n   two leaves, as the species of Listera and of Liparis.'),('Tweag','v. t.','To tweak.'),('Tweag','n.','Alt. of Tweague'),('Tweague','n.','A pinching condition; perplexity; trouble; distress.'),('Tweak','v. t.','To pinch and pull with a sudden jerk and twist; to\n   twitch; as, to tweak the nose.'),('Tweak','n.','A sharp pinch or jerk; a twist or twitch; as, a tweak of the\n   nose.'),('Tweak','n.','Trouble; distress; tweag.'),('Tweak','n.','A prostitute.'),('Tweed','n.','A soft and flexible fabric for men\'s wear, made wholly of\n   wool except in some inferior kinds, the wool being dyed, usually in two\n   colors, before weaving.'),('Tweedle','v. t.','To handle lightly; -- said with reference to awkward\n   fiddling; hence, to influence as if by fiddling; to coax; to allure.'),('Tweedle','v. t.','To twist.'),('Tweel','n. & v.','See Twill.'),('Tweer','n.','Same as Tuyere.'),('Tweese','n.','Alt. of Tweeze'),('Tweeze','n.','A surgeon\'s case of instruments.'),('Tweezers','n. pl.','Small pinchers used to pluck out hairs, and for other\n   purposes.'),('Twelfth','a.','Next in order after the eleventh; coming after eleven\n   others; -- the ordinal of twelve.'),('Twelfth','a.','Consisting, or being one of, twelve equal parts into which\n   anything is divided.'),('Twelfth','n.','The quotient of a unit divided by twelve; one of twelve\n   equal parts of one whole.'),('Twelfth','n.','The next in order after the eleventh.'),('Twelfth','n.','An interval comprising an octave and a fifth.'),('Twelfth-cake','n.','An ornamented cake distributed among friends or\n   visitors on the festival of Twelfth-night.'),('Twelfth-day','n.','See Twelfthtide.'),('Twelfth-night','n.','The evening of Epiphany, or the twelfth day after\n   Christmas, observed as a festival by various churches.'),('Twelfth-second','n.','A unit for the measurement of small intervals of\n   time, such that 1012 (ten trillion) of these units make one second.'),('Twelfthtide','n.','The twelfth day after Christmas; Epiphany; -- called\n   also Twelfth-day.'),('Twelve','a.','One more that eleven; two and ten; twice six; a dozen.'),('Twelve','n.','The number next following eleven; the sum of ten and two,\n   or of twice six; twelve units or objects; a dozen.'),('Twelve','n.','A symbol representing twelve units, as 12, or xii.'),('Twelvemo','a. & n.','See Duodecimo.'),('Twelvemonth','n.','A year which consists of twelve calendar months.'),('Twelvepence','n.','A shilling sterling, being about twenty-four cents.'),('Twelvepenny','a.','Sold for a shilling; worth or costing a shilling.'),('Twelvescore','n. & a.','Twelve times twenty; two hundred and forty.'),('Twentieth','a.','Next in order after the nineteenth; tenth after the\n   tenth; coming after nineteen others; -- the ordinal of twenty.'),('Twentieth','a.','Consisting, or being, one of twenty equal parts into\n   which anything is divided.'),('Twentieth','n.','The next in order after the nineteen; one coming after\n   nineteen others.'),('Twentieth','n.','The quotient of a unit divided by twenty; one of twenty\n   equal parts of one whole.'),('Twenty','a.','One more that nineteen; twice; as, twenty men.'),('Twenty','a.','An indefinite number more or less that twenty.'),('Twenties','pl. ','of Twenty'),('Twenty','n.','The number next following nineteen; the sum of twelve and\n   eight, or twice ten; twenty units or objects; a score.'),('Twenty','n.','A symbol representing twenty units, as 20, or xx.'),('Twentyfold','a.','Twenty times as many.'),('Twenty-fourmo','a.','Having twenty-four leaves to a sheet; as, a\n   twenty-fourmo form, book, leaf, size, etc.'),('Twenty-fourmo','n.','A book composed of sheets, each of which is folded\n   into twenty-four leaves; hence, indicating more or less definitely a\n   size of book whose sheets are so folded; -- usually written 24mo, or\n   24.'),('Twey','a.','Two.'),('Tweyfold','a.','Twofold.'),('Twibil','n.','A kind of mattock, or ax; esp., a tool like a pickax, but\n   having, instead of the points, flat terminations, one of which is\n   parallel to the handle, the other perpendicular to it.'),('Twibil','n.','A tool for making mortises.'),('Twibil','n.','A reaping hook.'),('Twibilled','a.','Armed or provided with a twibil or twibils.'),('Twice','adv.','Two times; once and again.'),('Twice','adv.','Doubly; in twofold quantity or degree; as, twice the sum;\n   he is twice as fortunate as his neighbor.'),('Twiddle','v. t.','To touch lightly, or play with; to tweedle; to twirl;\n   as, to twiddle one\'s thumbs; to twiddle a watch key.'),('Twiddle','v. i.','To play with anything; hence, to be busy about trifles.'),('Twiddle','n.','A slight twist with the fingers.'),('Twiddle','n.','A pimple.'),('Twifallowed','imp. & p. p.','of Twifallow'),('Twifallowing','p. pr. & vb. n.','of Twifallow'),('Twifallow','v. t.','To plow, or fallow, a second time (land that has been\n   once fallowed).'),('Twifold','a.','Twofold; double.'),('Twigged','imp. & p. p.','of Twig'),('Twigging','p. pr. & vb. n.','of Twig'),('Twig','v. t.','To twitch; to pull; to tweak.'),('Twig','v. t.','To understand the meaning of; to comprehend; as, do you\n   twig me?'),('Twig','v. t.','To observe slyly; also, to perceive; to discover.'),('Twig','n.','A small shoot or branch of a tree or other plant, of no\n   definite length or size.'),('Twig','v. t.','To beat with twigs.'),('Twiggen','a.','Made of twigs; wicker.'),('Twigger','n.','A fornicator.'),('Twiggy','a.','Of or pertaining to a twig or twigs; like a twig or twigs;\n   full of twigs; abounding with shoots.'),('Twight','v. t.','To twit.'),('Twight','','p. p. of Twitch.'),('Twighte','','imp. of Twitch.'),('Twigless','a.','Having no twigs.'),('Twigsome','a.','Full of, or abounding in, twigs; twiggy.'),('Twilight','n.','The light perceived before the rising, and after the\n   setting, of the sun, or when the sun is less than 18 below the\n   horizon, occasioned by the illumination of the earth\'s atmosphere by\n   the direct rays of the sun and their reflection on the earth.'),('Twilight','n.','faint light; a dubious or uncertain medium through which\n   anything is viewed.'),('Twilight','a.','Seen or done by twilight.'),('Twilight','a.','Imperfectly illuminated; shaded; obscure.'),('Twilled','imp. & p. p.','of Twill'),('Twilling','p. pr. & vb. n.','of Twill'),('Twill','v. i.','To weave, as cloth, so as to produce the appearance of\n   diagonal lines or ribs on the surface.'),('Twill','v. t.','An appearance of diagonal lines or ribs produced in\n   textile fabrics by causing the weft threads to pass over one and under\n   two, or over one and under three or more, warp threads, instead of over\n   one and under the next in regular succession, as in plain weaving.'),('Twill','v. t.','A fabric women with a twill.'),('Twill','v. t.','A quill, or spool, for yarn.'),('Twilly','n.','A machine for cleansing or loosening wool by the action of\n   a revolving cylinder covered with long iron spikes 