y repeated.'),('Twinkle','n.','The time of a wink; a twinkling.'),('Twinkler','n.','One who, or that which, twinkles, or winks; a winker; an\n   eye.'),('Twinkling','n.','The act of one who, or of that which, twinkles; a quick\n   movement of the eye; a wink; a twinkle.'),('Twinkling','n.','A shining with intermitted light; a scintillation; a\n   sparkling; as, the twinkling of the stars.'),('Twinkling','n.','The time of a wink; a moment; an instant.'),('Twinleaf','n.','See Jeffersonia.'),('Twinlike','a.','Closely resembling; being a counterpart.'),('Twinling','n.','A young or little twin, especially a twin lamb.'),('Twinned','a.','Composed of parts united according to a law of twinning.\n   See Twin, n., 4.'),('Twinner','n.','One who gives birth to twins; a breeder of twins.'),('Twinning','n.','The assemblage of two or more crystals, or parts of\n   crystals, in reversed position with reference to each other in\n   accordance with some definite law; also, rarely, in artificial twinning\n   (accomplished for example by pressure), the process by which this\n   reversal is brought about.'),('Twinter','n.','A domestic animal two winters old.'),('Twire','n.','A twisted filament; a thread.'),('Twire','v. i.','To peep; to glance obliquely; to leer.'),('Twire','v. i.','To twinkle; to glance; to gleam.'),('Twire','v. i.','To sing, or twitter.'),('Twire-pipe','n.','A vagabond musician.'),('Twirled','imp. & p. p.','of Twirl'),('Twirling','p. pr. & vb. n.','of Twirl'),('Twirl','v. t.','To move or turn round rapidly; to whirl round; to move\n   and turn rapidly with the fingers.'),('Twirl','v. i.','To revolve with velocity; to be whirled round rapidly.'),('Twirl','n.','The act of twirling; a rapid circular motion; a whirl or\n   whirling; quick rotation.'),('Twirl','n.','A twist; a convolution.'),('Twisted','imp. & p. p.','of Twist'),('Twisting','p. pr. & vb. n.','of Twist'),('Twist','v. t.','To contort; to writhe; to complicate; to crook spirally;\n   to convolve.'),('Twist','v. t.','Hence, to turn from the true form or meaning; to pervert;\n   as, to twist a passage cited from an author.'),('Twist','v. t.','To distort, as a solid body, by turning one part\n   relatively to another about an axis passing through both; to subject to\n   torsion; as, to twist a shaft.'),('Twist','v. t.','To wreathe; to wind; to encircle; to unite by\n   intertexture of parts.'),('Twist','v. t.','To wind into; to insinuate; -- used reflexively; as,\n   avarice twists itself into all human concerns.'),('Twist','v. t.','To unite by winding one thread, strand, or other flexible\n   substance, round another; to form by convolution, or winding separate\n   things round each other; as, to twist yarn or thread.'),('Twist','v. t.','Hence, to form as if by winding one part around another;\n   to wreathe; to make up.'),('Twist','v. t.','To form into a thread from many fine filaments; as, to\n   twist wool or cotton.'),('Twist','v. i.','To be contorted; to writhe; to be distorted by torsion;\n   to be united by winding round each other; to be or become twisted; as,\n   some strands will twist more easily than others.'),('Twist','v. i.','To follow a helical or spiral course; to be in the form\n   of a helix.'),('Twist','n.','The act of twisting; a contortion; a flexure; a convolution;\n   a bending.'),('Twist','n.','The form given in twisting.'),('Twist','n.','That which is formed by twisting, convoluting, or uniting\n   parts.'),('Twist','n.','A cord, thread, or anything flexible, formed by winding\n   strands or separate things round each other.'),('Twist','n.','A kind of closely twisted, strong sewing silk, used by\n   tailors, saddlers, and the like.'),('Twist','n.','A kind of cotton yarn, of several varieties.'),('Twist','n.','A roll of twisted dough, baked.'),('Twist','n.','A little twisted roll of tobacco.'),('Twist','n.','One of the threads of a warp, -- usually more tightly\n   twisted than the filling.'),('Twist','n.','A material for gun barrels, consisting of