ho, or that which, twitches.'),('Twitch grass','','See Quitch grass.'),('Twite','n.','The European tree sparrow.'),('Twite','n.','The mountain linnet (Linota flavirostris).'),('Twitlark','n.','The meadow pipit.'),('Twitter','n.','One who twits, or reproaches; an upbraider.'),('Twittered','imp. & p. p.','of Twitter'),('Twittering','p. pr. & vb. n.','of Twitter'),('Twitter','v. i.','To make a succession of small, tremulous, intermitted\n   noises.'),('Twitter','v. i.','To make the sound of a half-suppressed laugh; to\n   titter; to giggle.'),('Twitter','v. i.','To have a slight trembling of the nerves; to be excited\n   or agitated.'),('Twitter','v. t.','To utter with a twitter.'),('Twitter','n.','The act of twittering; a small, tremulous, intermitted\n   noise, as that made by a swallow.'),('Twitter','n.','A half-suppressed laugh; a fit of laughter partially\n   restrained; a titter; a giggle.'),('Twitter','n.','A slight trembling or agitation of the nerves.'),('Twittering','n.','The act of one who, or that which, twitters.'),('Twittering','n.','A slight nervous excitement or agitation, such as is\n   caused by desire, expectation, or suspense.'),('Twittingly','adv.','In a twitting manner; with upbraiding.'),('Twittle-twattle','n.','Tattle; gabble.'),('\'Twixt','','An abbreviation of Betwixt, used in poetry, or in colloquial\n   language.'),('\'Twixt-brain','n.','The thalamen/cephalon.'),('Two','n.','One and one; twice one.'),('Two','n.','The sum of one and one; the number next greater than one, and\n   next less than three; two units or objects.'),('Two','n.','A symbol representing two units, as 2, II., or ii.'),('Two-capsuled','a.','Having two distinct capsules; bicapsular.'),('Two-cleft','a.','Divided about half way from the border to the base into\n   two segments; bifid.'),('Two-decker','n.','A vessel of war carrying guns on two decks.'),('Two-edged','a.','Having two edges, or edges on both sides; as, a\n   two-edged sword.'),('Twofold','a.','Double; duplicate; 