ich the shogun, or former commander in chief\n   of the Japanese army, was known to foreigners.'),('Tydy','n.','Same as Tidy.'),('Tye','n.','A knot; a tie.'),('Tye','n.','A chain or rope, one end of which passes through the mast, and\n   is made fast to the center of a yard; the other end is attached to a\n   tackle, by means of which the yard is hoisted or lowered.'),('Tye','n.','A trough for washing ores.'),('Tye','v. t.','See Tie, the proper orthography.'),('Tyer','n.','One who ties, or unites.'),('Tyfoon','n.','See Typhoon.'),('Tyger','n.','A tiger.'),('Tying','','p. pr. of Tie.'),('Tying','n.','The act or process of washing ores in a buddle.'),('Tyke','n.','See 2d Tike.'),('Tylari','pl. ','of Tylarus'),('Tylarus','n.','One of the pads on the under surface of the toes of birds.'),('Tyler','n.','See 2d Tiler.'),('Tylopoda','n. pl.','A tribe of ungulates comprising the camels.'),('Tyloses','pl. ','of Tylosis'),('Tylosis','n.','An intrusion of one vegetable cell into the cavity of\n   another, sometimes forming there an irregular mass of cells.'),('Tymbal','n.','A kind of kettledrum.'),('Tymp','n.','A hollow water-cooled iron casting in the upper part of the\n   archway in which the dam stands.'),('Tympan','n.','A drum.'),('Tympan','n.','A panel; a tympanum.'),('Tympan','n.','A frame covered with parchment or cloth, on which the blank\n   sheets are put, in order to be laid on the form to be impressed.'),('Tympanal','n.','Tympanic.'),('Tympanic','a.','Like a tympanum or drum; acting like a drumhead; as, a\n   tympanic membrane.'),('Tympanic','a.','Of or pertaining to the tympanum.'),('Tympanic','n.','The tympanic bone.'),('Tympanist','n.','One who beats a drum.'),('Tympanites','n.','A flatulent distention of the belly; tympany.'),('Tympanitic','a.','Of, pertaining to, or affected with, tympanites.'),('Tympanitis','n.','Inflammation of the lining membrane of the middle ear.'),('Tympanize','v. i.','To drum.'),('Tympanized','imp. & p. p.','of Tympanize'),('Tympanizing','p. pr. & vb. n.','of Tympanize'),('Tympanize','v. t.','To stretch, as a skin over the head of a drum; to\n   make into a drum or drumhead, or cause to act or sound like a drum.'),('Tympani','pl. ','of Tympano'),('Tympano','n.','A kettledrum; -- chiefly used in the plural to denote the\n   kettledrums of an orchestra. See Kettledrum.'),('Tympano-','','A combining form used in anatomy to indicate connection\n   with, or relation to, the tympanum; as in tympanohyal,\n   tympano-Eustachian.'),('Tympanohyal','a.','Of or pertaining to the tympanum and the hyoidean\n   arch.'),('Tympanohyal','n.','The proximal segment in the hyoidean arch, becoming a\n   part of the styloid process of the temporal bone in adult man.'),('Tympanums','pl. ','of Tympanum'),('Tympana','pl. ','of Tympanum'),('Tympanum','n.','The ear drum, or middle ear. Sometimes applied\n   incorrectly to the tympanic membrane. See Ear.'),('Tympanum','n.','A chamber in the anterior part of the syrinx of birds.'),('Tympanum','n.','One of the naked, inflatable air sacs on the neck of the\n   prairie chicken and other species of grouse.'),('Tympanum','n.','The recessed face of a pediment within the frame made by\n   the upper and lower cornices, being usually a triangular space or\n   table.'),('Tympanum','n.','The space within an arch, and above a lintel or a\n   subordinate arch, spanning the opening below the arch.'),('Tympanum','n.','A drum-shaped wheel with spirally curved partitions by\n   which water is raised to the axis when the wheel revolves with the\n   lower part of the circumference submerged, -- used for raising water,\n   as for irrigation.'),('Tympany','n.','A flatulent distention of the belly; tympanites.'),('Tympany','n.','Hence, inflation; conceit; bombast; turgidness.'),('Tynd','v. t.','To shut; to close.'),('Tyne','v. t.','To lose.'),('Tyne','v. i.','To become lost; to perish.'),('Tyne','n.','A prong or point of an antler.'),('Tyne','n.','Anxiety; tine.'),('Tyny','a.','Small; tiny.'),('Typal','a.','Relating to a type or types; belonging to types; serving as\n   a type; typical.'),('-type','n.','A combining form signifying impressed form; stamp; print;\n   type; typical form; representative; as in stereotype phototype,\n   ferrotype, monotype.'),('Type','n.','The mark or impression of something; stamp; impressed sign;\n   emblem.'),('Type','n.','Form or character impressed; style; semblance.'),('Type','n.','A figure or representation of something to come; a token; a\n   sign; a symbol; -- correlative to antitype.'),('Type','n.','That which possesses or exemplifies characteristic qualities;\n   the representative.'),('Type','n.','A general form or structure common to a number of\n   individuals; hence, the ideal representation of a species, genus, or\n   other group, combining the essential characteristics; an animal or\n   plant possessing or exemplifying the essential characteristics of a\n   species, genus, or other group. Also, a group or division of animals\n   having a certain typical or characteristic structure of body maintained\n   within the group.'),('Type','n.','The original object, or class of objects, scene, face, or\n   conception, which becomes the subject of a copy; esp., the design on\n   the face of a medal or a coin.'),('Type','n.','A simple compound, used as a mode or pattern to which other\n   compounds are conveniently regarded as being related, and from which\n   they may be actually or theoretically derived.'),('Type','n.','A raised letter, figure, accent, or other character, cast in\n   metal or cut in wood, used in printing.'),('Type','n.','Such letters or characters, in general, or the whole quantity\n   of them used in printing, spoken of collectively; any number or mass of\n   such letters or characters, however disposed.'),('Typed','imp. & p. p.','of Type'),('Typing','p. pr. & vb. n.','of Type'),('Type','v. t.','To represent by a type, model, or symbol beforehand; to\n   prefigure.'),('Type','v. t.','To furnish an expression or copy of; to represent; to\n   typify.'),('Typesetter','n.','One who, or that which, sets type; a compositor; a\n   machine for setting type.'),('Typesetting','n.','The act or art of setting type.'),('Typewrite','v. t. & i.','To write with a typewriter.'),('Typewriter','n.','An instrument for writing by means of type, a\n   typewheel, or the like, in which the operator makes use of a sort of\n   keyboard, in order to obtain printed impressions of the characters upon\n   paper.'),('Typewriter','n.','One who uses such an instrument.'),('Typewriting','n.','The act or art of using a typewriter; also, a print\n   made with a typewriter.'),('Typhlitis','n.','Inflammation of the caecum.'),('Typhlosole','n.','A fold of the wall which projects into the cavity of\n   the intestine in bivalve mollusks, certain annelids, starfishes, and\n   some other animals.'),('Typhoean','a.','Of or pertaining to Typhoeus (t/*f/\"/s), the fabled giant\n   of Greek mythology, having a hundred heads; resembling Typhoeus.'),('Typhoid','a.','Of or pertaining to typhus; resembling typhus; of a low\n   grade like typhus; as, typhoid symptoms.'),('Typhomalarial','a.','Pertaining to typhoid fever and malaria; as,\n   typhomalarial fever, a form of fever having symptoms both of malarial\n   and typhoid fever.'),('Typhomania','n.','A low delirium common in typhus fever.'),('Typhon','n.','According to Hesiod, the son of Typhoeus, and father of the\n   winds, but later identified with him.'),('Typhon','n.','A violent whirlwind; a typhoon.'),('Typhoon','n.','A violent whirlwind; specifically, a violent whirlwind\n   occurring in the Chinese seas.'),('Typhos','n.','Typhus.'),('Typhotoxin','n.','A basic substance, C7H17NO2, formed from the growth of\n   the typhoid bacillus on meat pulp. It induces in small animals\n   lethargic conditions with liquid dejecta.'),('Typhous','a.','Of or pertaining to typhus; of the nature of typhus.'),('Typhus','n.','A contagious continued fever lasting from two to three\n   weeks, attended with great prostration and cerebral disorder, and\n   marked by a copious eruption of red spots upon the body. Also called\n   jail fever, famine fever, putrid fever, spottled fever, etc. See Jail\n   fever, under Jail.'),('Typic','a.','Typical.'),('Typical','a.','Of the nature of a type; representing something by a form,\n   model, or resemblance; emblematic; prefigurative.'),('Typical','a.','Combining or exhibiting the essential characteristics of a\n   group; as, a typical genus.'),('Typification','n.','The act of typifying, or representing by a figure.'),('Typifier','n.','One who, or that which, typifies.'),('Typified','imp. & p. p.','of Typify'),('Typifying','p. pr. & vb. n.','of Typify'),('Typify','v. t.','To represent by an image, form, model, or resemblance.'),('Typo','n.','A compositor.'),('Typocosmy','n.','A representation of the world.'),('Typographer','n.','A printer.'),('Typographic','a.','Alt. of Typographical'),('Typographical','a.','Of or pertaining to the act or act of representing\n   by types or symbols; emblematic; figurative; typical.'),('Typographical','a.','Of or pertaining to typography or printing; as, the\n   typographic art.'),('Typography','n.','The act or art of expressing by means of types or\n   symbols; emblematical or hieroglyphic representation.'),('Typography','n.','The art of printing with types; the use of types to\n   produce impressions on paper, vellum, etc.'),('Typolite','n.','A stone or fossil which has on it impressions or figures\n   of plants and animals.'),('Typology','n.','A discourse or treatise on types.'),('Typology','n.','The doctrine of types.'),('Typothetae','n. pl.','Printers; -- used in the name of an association of\n   the master printers of the United States and Canada, called The United\n   Typothetae of America.'),('Tyran','n.','A tyrant.'),('Tyranness','n.','A female tyrant.'),('Tyrannic','a.','Alt. of Tyrannical'),('Tyrannical','a.','Of or pertaining to a tyrant; suiting a tyrant;\n   unjustly severe in government; absolute; imperious; despotic; cruel;\n   arbitrary; as, a tyrannical prince; a tyrannical master; tyrannical\n   government.'),('Tyrannicidal','a.','Of or pertaining to tyrannicide, or the murder of a\n   tyrant.'),('Tyrannicide','n.','The act of killing a tyrant.'),('Tyrannicide','n.','One who kills a tyrant.'),('Tyrannish','a.','Like a tyrant; tyrannical.'),('Tyrannized','imp. & p. p.','of Tyrannize'),('Tyrannizing','p. pr. & vb. n.','of Tyrannize'),('Tyrannize','v. i.','To act the tyrant; to exercise arbitrary power; to\n   rule with unjust and oppressive severity; to exercise power others not\n   permitted by law or required by justice, or with a severity not\n   necessary to the ends of justice and government; as, a prince will\n   often tyrannize over his subjects; masters sometimes tyrannize over\n   their servants or apprentices.'),('Tyrannize','v. t.','To subject to arbitrary, oppressive, or tyrannical\n   treatment; to oppress.'),('Tyrannous','a.','Tyrannical; arbitrary; unjustly severe; despotic.'),('Tyranny','n.','The government or authority of a tyrant; a country\n   governed by an absolute ruler; hence, arbitrary or despotic exercise of\n   power; exercise of power over subjects and others with a rigor not\n   authorized by law or justice, or not requisite for the purposes of\n   government.'),('Tyranny','n.','Cruel government or discipline; as, the tyranny of a\n   schoolmaster.'),('Tyranny','n.','Severity; rigor; inclemency.'),('Tyrant','n.','An absolute ruler; a sovereign unrestrained by law or\n   constitution; a usurper of sovereignty.'),('Tyrant','n.','Specifically, a monarch, or other ruler or master, who uses\n   power to oppress his subjects; a person who exercises unlawful\n   authority, or lawful authority in an unlawful manner; one who by\n   taxation, injustice, or cruel punishment, or the demand of unreasonable\n   services, imposes burdens and hardships on those under his control,\n   which law and humanity do not authorize, or which the purposes of\n   government do not require; a cruel master; an oppressor.'),('Tyrant','n.','Any one of numerous species of American clamatorial birds\n   belonging to the family Tyrannidae; -- called also tyrant bird.'),('Tyrant','v. i.','To act like a tyrant; to play the tyrant; to tyrannical.'),('Tyre','','Curdled milk.'),('Tyre','n. & v.','Attire. See 2d and 3d Tire.'),('Tyre','v. i.','To prey. See 4th Tire.'),('Tyrian','a.','Of or pertaining to Tyre or its people.'),('Tyrian','a.','Being of the color called Tyrian purple.'),('Tyrian','n.','A native of Tyre.'),('Tyros','pl. ','of Tyro'),('Tyro','n.','A beginner in learning; one who is in the rudiments of any\n   branch of study; a person imperfectly acquainted with a subject; a\n   novice.'),('Tyrociny','n.','The state of being a tyro, or beginner; apprenticeship.'),('Tyrolite','n.','A translucent mineral of a green color and pearly or\n   vitreous luster. It is a hydrous arseniate of copper.'),('Tyronism','n.','The state of being a tyro, or beginner.'),('Tyrosin','n.','A white crystalline nitrogenous substance present in small\n   amount in the pancreas and spleen, and formed in large quantity from\n   the decomposition of proteid matter by various means, -- as by\n   pancreatic digestion, by putrefaction as of cheese, by the action of\n   boiling acids, etc. Chemically, it consists of oxyphenol and\n   amidopropionic acid, and by decomposition yields oxybenzoic acid, or\n   some other benzol derivative.'),('Tyrotoxicon','n.','A ptomaine discovered by Vaughan in putrid cheese and\n   other dairy products, and producing symptoms similar to cholera\n   infantum. Chemically, it appears to be related to, or identical with,\n   diazobenzol.'),('Tyrotoxine','n.','Same as Tyrotoxicon.'),('Tysonite','n.','A fluoride of the cerium metals occurring in hexagonal\n   crystals of a pale yellow color. Cf. Fluocerite.'),('Tystie','n.','The black guillemot.'),('Tythe','n.','See Tithe.'),('Tything','n.','See Tithing.'),('Tzar','n.','The emperor of Russia. See Czar.'),('Tzarina','n.','Alt. of Tzaritza'),('Tzaritza','n.','The empress of Russia. See Czarina.'),('Tzetze','n.','Same as Tsetse.\n   U () the twenty-first letter of the English alphabet, is a cursive form\n   of the letter V, with which it was formerly used interchangeably, both\n   letters being then used both as vowels and consonants. U and V are now,\n   however, differentiated, U being used only as a vowel or semivowel, and\n   V only as a consonant. The true primary vowel sound of U, in\n   Anglo-Saxon, was the sound which it still retains in most of the\n   languages of Europe, that of long oo, as in tool, and short oo, as in\n   wood, answering to the French ou in tour. Etymologically U is most\n   closely related to o, y (vowel), w, and v; as in two, duet, dyad,\n   twice; top, tuft; sop, sup; auspice, aviary. See V, also O and Y.'),('Uakari','n.','Same as Ouakari.'),('Uberous','a.','Fruitful; copious; abundant; plentiful.'),('Uberty','n.','Fruitfulness; copiousness; abundance; plenty.'),('Ubication','n.','Alt. of Ubiety'),('Ubiety','n.','The quality or state of being in a place; local relation;\n   position or location; whereness.'),('Ubiquarian','a.','Ubiquitous.'),('Ubiquitist','n.','Alt. of Ubiquitarian'),('Ubiquitarian','n.','One of a school of Lutheran divines which held that\n   the body of Christ is present everywhere, and especially in the\n   eucharist, in virtue of his omnipresence. Called also ubiquitist, and\n   ubiquitary.'),('Ubiquitariness','n.','Quality or state of being ubiquitary, or\n   ubiquitous.'),('Ubiquitary','a.','Ubiquitous.'),('Ubiquitaries','pl. ','of Ubiquitary'),('Ubiquitary','n.','One who exists everywhere.'),('Ubiquitary','n.','A ubiquist.'),('Ubiquitist','n.','Same as Ubiquist.'),('Ubiquitous','a.','Existing or being everywhere, or in all places, at the\n   same time; omnipresent.'),('Ubiquity','n.','Existence everywhere, or in places, at the same time;\n   omnipresence; as, the ubiquity of God is not disputed by those who\n   admit his existence.'),('Ubiquity','n.','The doctrine, as formulated by Luther, that Christ\'s\n   glorified body is omnipresent.'),('Uchees','n. pl.','A tribe of North American Indians belonging to the\n   Creek confederation.'),('Uckewallist','n.','One of a sect of rigid Anabaptists, which originated\n   in 1637, and whose tenets were essentially the same as those of the\n   Mennonists. In addition, however, they held that Judas and the\n   murderers of Christ were saved. So called from the founder of the sect,\n   Ucke Wallis, a native of Friesland.'),('Udal','n.','In Shetland and Orkney, a freehold; property held by udal, or\n   allodial, right.'),('Udal','a.','Allodial; -- a term used in Finland, Shetland, and Orkney.\n   See Allodial.'),('Udaler','n.','Alt. of Udalman'),('Udalman','n.','In the Shetland and Orkney Islands, one who holds property\n   by udal, or allodial, right.'),('Udder','n.','The glandular organ in which milk is secreted and stored; --\n   popularly called the bag in cows and other quadrupeds. See Mamma.'),('Udder','n.','One of the breasts of a woman.'),('Uddered','a.','Having an udder or udders.'),('Udderless','a.','Destitute or deprived of an udder.'),('Udderless','a.','Hence, without mother\'s milk; motherless; as, udderless\n   lambs.'),('Udometer','n.','A rain gauge.'),('Ugh','interj.','An exclamation expressive of disgust, horror, or recoil.\n   Its utterance is usually accompanied by a shudder.'),('Uglesome','a.','Ugly.'),('Uglify','v. t.','To disfigure; to make ugly.'),('Uglily','adv.','In an ugly manner; with deformity.'),('Ugliness','n.','The quality or state of being ugly.'),('Ugly','superl.','Offensive to the sight; contrary to beauty; being of\n   disagreeable or loathsome aspect; unsightly; repulsive; deformed.'),('Ugly','superl.','Ill-natured; crossgrained; quarrelsome; as, an ugly\n   temper; to feel ugly.'),('Ugly','superl.','Unpleasant; disagreeable; likely to cause trouble or\n   loss; as, an ugly rumor; an ugly customer.'),('Ugly','n.','A shade for the face, projecting from the bonnet.'),('Ugly','v. t.','To make ugly.'),('Ugrian','n. pl.','A Mongolian race, ancestors of the Finns.'),('Ugsome','a.','Ugly; offensive; loathsome.'),('Uhlan','n.','One of a certain description of militia among the Tartars.'),('Uhlan','n.','One of a kind of light cavalry of Tartaric origin, first\n   introduced into European armies in Poland. They are armed with lances,\n   pistols, and sabers, and are employed chiefly as skirmishers.'),('Uintatherium','n.','An extinct genus of large Eocene ungulates allied to\n   Dinoceras. This name is sometimes used for nearly all the known species\n   of the group. See Dinoceras.'),('Ukase','n.','In Russia, a published proclamation or imperial order,\n   having the force of law.'),('Ulan','n.','See Uhlan.'),('Ularburong','n.','A large East Indian nocturnal tree snake (Dipsas\n   dendrophila). It is not venomous.'),('Ulcer','n.','A solution of continuity in any of the soft parts of the\n   body, discharging purulent matter, found on a surface, especially one\n   of the natural surfaces of the body, and originating generally in a\n   constitutional disorder; a sore discharging pus. It is distinguished\n   from an abscess, which has its beginning, at least, in the depth of the\n   tissues.'),('Ulcer','n.','Fig.: Anything that festers and corrupts like an open sore;\n   a vice in character.'),('Ulcer','v. t.','To ulcerate.'),('Ulcerable','a.','Capable of ulcerating.'),('Ulcerated','imp. & p. p.','of Ulcerate'),('Ulcerating','p. pr. & vb. n.','of Ulcerate'),('Ulcerate','v. i.','To be formed into an ulcer; to become ulcerous.'),('Ulcerate','v. t.','To affect with, or as with, an ulcer or ulcers.'),('Ulcerated','a.','Affected with, or as with, an ulcer or ulcers; as, an\n   ulcerated sore throat.'),('Ulceration','n.','The process of forming an ulcer, or of becoming\n   ulcerous; the state of being ulcerated; also, an ulcer.'),('Ulcerative','a.','Of or pertaining to ulcers; as, an ulcerative process.'),('Ulcered','a.','Ulcerous; ulcerated.'),('Ulcerous','a.','Having the nature or character of an ulcer; discharging\n   purulent or other matter.'),('Ulcerous','a.','Affected with an ulcer or ulcers; ulcerated.'),('Ulcuscle','n.','Alt. of Ulcuscule'),('Ulcuscule','n.','A little ulcer.'),('Ule','n.','A Mexican and Central American tree (Castilloa elastica and C.\n   Markhamiana) related to the breadfruit tree. Its milky juice contains\n   caoutchouc. Called also ule tree.'),('Ulema','n.','A college or corporation in Turkey composed of the\n   hierarchy, namely, the imams, or ministers of religion, the muftis, or\n   doctors of law, and the cadis, or administrators of justice.'),('Ulexite','n.','A mineral occurring in white rounded crystalline masses.\n   It is a hydrous borate of lime and soda.'),('Uliginose','a.','Alt. of Uliginous'),('Uliginous','a.','Muddy; oozy; slimy; also, growing in muddy places.'),('Ullage','n.','The amount which a vessel, as a cask, of liquor lacks of\n   being full; wantage; deficiency.'),('Ullet','n.','A European owl (Syrnium aluco) of a tawny color; -- called\n   also uluia.'),('Ullmannite','n.','A brittle mineral of a steel-gray color and metallic\n   luster, containing antimony, arsenic, sulphur, and nickel.'),('Ulluco','n.','See Melluc/o.'),('Ulmaceous','a.','Of or pertaining to a suborder of urticaceous plants, of\n   which the elm is the type.'),('Ulmate','n.','A salt of ulmic acid.'),('Ulmic','a.','Pertaining to ulmin; designating an acid obtained from\n   ulmin.'),('Ulmin','n.','A brown amorphous substance found in decaying vegetation.\n   Cf. Humin.'),('Ulmus','n.','A genus of trees including the elm.'),('Ulna','n.','The postaxial bone of the forearm, or branchium,\n   corresponding to the fibula of the hind limb. See Radius.'),('Ulna','n.','An ell; also, a yard.'),('Ulnage','n.','Measurement by the ell; alnage.'),('Ulnar','a.','Of or pertaining to the ulna, or the elbow; as, the ulnar\n   nerve.'),('Ulnaria','pl. ','of Ulnare'),('Ulnare','n.','One of the bones or cartilages of the carpus, which\n   articulates with the ulna and corresponds to the cuneiform in man.'),('Ulodendron','n.','A genus of fossil trees.'),('Ulonata','n. pl.','A division of insects nearly equivalent to the true\n   Orthoptera.'),('Ulotrichan','a.','Of or pertaining to the Ulotrichi.'),('Ulotrichan','n.','One of the Ulotrichi.'),('Ulotrichi','n. pl.','The division of mankind which embraces the races\n   having woolly or crispy hair. Cf. Leiotrichi.'),('Ulotrichous','a.','Having woolly or crispy hair; -- opposed to\n   leiotrichous.'),('Ulster','n.','A long, loose overcoat, worn by men and women, originally\n   made of frieze from Ulster, Ireland.'),('Ulterior','a.','Situated beyond, or on the farther side; thither; --\n   correlative with hither.'),('Ulterior','a.','Further; remoter; more distant; succeeding; as, ulterior\n   demands or propositions; ulterior views; what ulterior measures will be\n   adopted is uncertain.'),('Ulterior','n.','Ulterior side or part.'),('Ulteriorly','adv.','More distantly or remotely.'),('Ultima','a.','Most remote; furthest; final; last.'),('Ultima','n.','The last syllable of a word.'),('Ultimate','a.','Farthest; most remote in space or time; extreme; last;\n   final.'),('Ultimate','a.','Last in a train of progression or consequences; tended\n   toward by all that precedes; arrived at, as the last result; final.'),('Ultimate','a.','Incapable of further analysis; incapable of further\n   division or separation; constituent; elemental; as, an ultimate\n   constituent of matter.'),('Ultimated','imp. & p. p.','of Ultimate'),('Ultimating','p. pr. & vb. n.','of Ultimate'),('Ultimate','v. t. & i.','To come or bring to an end; to eventuate; to end.'),('Ultimate','v. t. & i.','To come or bring into use or practice.'),('Ultimately','adv.','As a final consequence; at last; in the end; as,\n   afflictions often tend to correct immoral habits, and ultimately prove\n   blessings.'),('Ultimation','n.','State of being ultimate; that which is ultimate, or\n   final; ultimatum.'),('Ultimatums','pl. ','of Ultimatum'),('Ultimata','pl. ','of Ultimatum'),('Ultimatum','n.','A final proposition, concession, or condition;\n   especially, the final propositions, conditions, or terms, offered by\n   either of the parties in a diplomatic negotiation; the most favorable\n   terms a negotiator can offer, the rejection of which usually puts an\n   end to the hesitation.'),('Ultime','a.','Ultimate; final.'),('Ultimity','n.','The last stage or consequence; finality.'),('Ultimo','','In the month immediately preceding the present; as, on the\n   1st ultimo; -- usually abbreviated to ult. Cf. Proximo.'),('Ultion','n.','The act of taking vengeance; revenge.'),('Ultra-','a.','A prefix from the Latin ultra beyond (see Ulterior), having\n   in composition the signification beyond, on the other side, chiefly\n   when joined with words expressing relations of place; as, ultramarine,\n   ultramontane, ultramundane, ultratropical, etc. In other relations it\n   has the sense of excessively, exceedingly, beyond what is common,\n   natural, right, or proper; as, ultraconservative; ultrademocratic,\n   ultradespotic, ultraliberal, ultraradical, etc.'),('Ultra','a.','Going beyond others, or beyond due limit; extreme;\n   fanatical; uncompromising; as, an ultra reformer; ultra measures.'),('Ultra','n.','One who advocates extreme measures; an ultraist; an\n   extremist; a radical.'),('Ultrage','n.','Outrage.'),('Ultraism','n.','The principles of those who advocate extreme measures, as\n   radical reform, and the like.'),('Ultraist','n.','One who pushes a principle or measure to extremes; an\n   extremist; a radical; an ultra.'),('Ultramarine','a.','Situated or being beyond the sea.'),('Ultramarine','n.','A blue pigment formerly obtained by powdering lapis\n   lazuli, but now produced in large quantities by fusing together silica,\n   alumina, soda, and sulphur, thus forming a glass, colored blue by the\n   sodium polysulphides made in the fusion. Also used adjectively.'),('Ultramontane','','Being beyond the mountains; specifically, being beyond\n   the Alps, in respect to the one who speaks.'),('Ultramontane','n.','One who resides beyond the mountains, especially\n   beyond the Alps; a foreigner.'),('Ultramontane','n.','One who maintains extreme views favoring the pope\'s\n   supremacy. See Ultramontanism.'),('Ultramontanism','n.','The principles of those within the Roman Catholic\n   Church who maintain extreme views favoring the pope\'s supremacy; -- so\n   used by those living north of the Alps in reference to the Italians; --\n   rarely used in an opposite sense, as referring to the views of those\n   living north of the Alps and opposed to the papal claims. Cf.\n   Gallicanism.'),('Ultramontanist','n.','One who upholds ultramontanism.'),('Ultramundane','a.','Being beyond the world, or beyond the limits of our\n   system.'),('Ultrared','a.','Situated beyond or below the red rays; as, the ultrated\n   rays of the spectrum, which are less refrangible than the red.'),('Ultratropical','a.','Situated beyond, or outside of, the tropics;\n   extratropical; also, having an excessively tropical temperature; warmer\n   than the tropics.'),('Ultraviolet','a.','Lying outside the visible spectrum at its violet end;\n   -- said of rays more refrangible than the extreme violet rays of the\n   spectrum.'),('Ultra vires','','Beyond power; transcending authority; -- a phrase used\n   frequently in relation to acts or enactments by corporations in excess\n   of their chartered or statutory rights.'),('Ultrazodiacal','a.','Outside the zodiac; being in that part of the\n   heavens that is more than eight degrees from the ecliptic; as,\n   ultrazodiacal planets, that is, those planets which in part of their\n   orbits go beyond the zodiac.'),('Ultroneous','a.','Spontaneous; voluntary.'),('Ulula','n.','A genus of owls including the great gray owl (Ulula cinerea)\n   of Arctic America, and other similar species. See Illust. of Owl.'),('Ululant','a.','Howling; wailing.'),('Ululated','imp. & p. p.','of Ululate'),('Ululating','p. pr. & vb. n.','of Ululate'),('Ululate','v. i.','To howl, as a dog or a wolf; to wail; as, ululating\n   jackals.'),('Ululation','n.','A howling, as of a dog or wolf; a wailing.'),('Ulva','n.','A genus of thin papery bright green seaweeds including the\n   kinds called sea lettuce.'),('Umbe','prep.','About.'),('Umbecast','v. i.','To cast about; to consider; to ponder.'),('Umbel','n.','A kind of flower cluster in which the flower stalks radiate\n   from a common point, as in the carrot and milkweed. It is simple or\n   compound; in the latter case, each peduncle bears another little umbel,\n   called umbellet, or umbellule.'),('Umbellar','a.','Of or pertaining to an umbel; having the form of an\n   umbel.'),('Umbellate','a.','Alt. of Umbellated'),('Umbellated','a.','Bearing umbels; pertaining to an umbel; umbel-like; as,\n   umbellate plants or flowers.'),('Umbellet','n.','A small or partial umbel; an umbellule.'),('Umbellic','a.','Pertaining to, or obtained from, certain umbelliferous\n   plants; as, umbellic acid.'),('Umbellifer','n.','A plant producing an umbel or umbels.'),('Umbelliferone','n.','A tasteless white crystalline substance, C9H6O3,\n   found in the bark of a certain plant (Daphne Mezereum), and also\n   obtained by the distillation of certain gums from the Umbelliferae, as\n   galbanum, asafetida, etc. It is analogous to coumarin. Called also\n   hydroxy-coumarin.'),('Umbelliferous','a.','Producing umbels.'),('Umbelliferous','a.','Of or pertaining to a natural order (Umbelliferae)\n   of plants, of which the parsley, carrot, parsnip, and fennel are\n   well-known examples.'),('Umbellularia','n.','A genus of deep-sea alcyonaria consisting of a\n   cluster of large flowerlike polyps situated at the summit of a long,\n   slender stem which stands upright in the mud, supported by a bulbous\n   base.'),('Umbellule','n.','An umbellet.'),('Umber','n.','A brown or reddish pigment used in both oil and water\n   colors, obtained from certain natural clays variously colored by the\n   oxides of iron and manganese. It is commonly heated or burned before\n   being used, and is then called burnt umber; when not heated, it is\n   called raw umber. See Burnt umber, below.'),('Umber','n.','An umbrere.'),('Umber','n.','See Grayling, 1.'),('Umber','n.','An African wading bird (Scopus umbretta) allied to the\n   storks and herons. It is dull dusky brown, and has a large occipital\n   crest. Called also umbrette, umbre, and umber bird.'),('Umber','a.','Of or pertaining to umber; resembling umber; olive-brown;\n   dark brown; dark; dusky.'),('Umber','v. t.','To color with umber; to shade or darken; as, to umber\n   over one\'s face.'),('Umbery','a.','Of or pertaining to umber; like umber; as, umbery gold.'),('Umbilic','n.','The navel; the center.'),('Umbilic','n.','An umbilicus. See Umbilicus, 5 (b).'),('Umbilic','a.','See Umbilical, 1.'),('Umbilical','n.','Of or pertaining to an umbilicus, or umbilical cord;\n   umbilic.'),('Umbilical','n.','Pertaining to the center; central.'),('Umbilicate','a.','Alt. of Umbilicated'),('Umbilicated','a.','Depressed in the middle, like a navel, as a flower,\n   fruit, or leaf; navel-shaped; having an umbilicus; as, an umbilicated\n   smallpox vesicle.'),('Umbilicated','a.','Supported by a stalk at the central point.'),('Umbilication','n.','A slight, navel-like depression, or dimpling, of the\n   center of a rounded body; as, the umbilication of a smallpox vesicle;\n   also, the condition of being umbilicated.'),('Umbilicus','n.','The depression, or mark, in the median line of the\n   abdomen, which indicates the point where the umbilical cord separated\n   from the fetus; the navel.'),('Umbilicus','n.','An ornamented or painted ball or boss fastened at each\n   end of the stick on which manuscripts were rolled.'),('Umbilicus','n.','The hilum.'),('Umbilicus','n.','A depression or opening in the center of the base of\n   many spiral shells.'),('Umbilicus','n.','Either one of the two apertures in the calamus of a\n   feather.'),('Umbilicus','n.','One of foci of an ellipse, or other curve.'),('Umbilicus','n.','A point of a surface at which the curvatures of the\n   normal sections are all equal to each other. A sphere may be osculatory\n   to the surface in every direction at an umbilicus. Called also umbilic.'),('Umble pie','','A pie made of umbles. See To eat humble pie, under Humble.'),('Umbles','n. pl.','The entrails and coarser parts of a deer; hence,\n   sometimes, entrails, in general.'),('Umbones','pl. ','of Umbo'),('Umbos','pl. ','of Umbo'),('Umbo','n.','The boss of a shield, at or near the middle, and usually\n   projecting, sometimes in a sharp spike.'),('Umbo','n.','A boss, or rounded elevation, or a corresponding depression,\n   in a palate, disk, or membrane; as, the umbo in the integument of the\n   larvae of echinoderms or in the tympanic membrane of the ear.'),('Umbo','n.','One of the lateral prominence just above the hinge of a\n   bivalve shell.'),('Umbonate','a.','Alt. of Umbonated'),('Umbonated','a.','Having a conical or rounded projection or protuberance,\n   like a boss.'),('Umbrae','pl. ','of Umbra'),('Umbra','n.','The conical shadow projected from a planet or satellite, on\n   the side opposite to the sun, within which a spectator could see no\n   portion of the sun\'s disk; -- used in contradistinction from penumbra.\n   See Penumbra.'),('Umbra','n.','The central dark portion, or nucleus, of a sun spot.'),('Umbra','n.','The fainter part of a sun spot; -- now more commonly called\n   penumbra.'),('Umbra','n.','Any one of several species of sciaenoid food fishes of the\n   genus Umbrina, especially the Mediterranean species (U. cirrhosa),\n   which is highly esteemed as a market fish; -- called also ombre, and\n   umbrine.'),('Umbraculiferous','a.','Bearing something like an open umbrella.'),('Umbraculiform','a.','Having the form of anything that serves to shade, as\n   a tree top, an umbrella, and the like; specifically (Bot.), having the\n   form of an umbrella; umbrella-shaped.'),('Umbrage','n.','Shade; shadow; obscurity; hence, that which affords a\n   shade, as a screen of trees or foliage.'),('Umbrage','n.','Shadowy resemblance; shadow.'),('Umbrage','n.','The feeling of being overshadowed; jealousy of another, as\n   standing in one\'s light or way; hence, suspicion of injury or wrong;\n   offense; resentment.'),('Umbrageous','a.','Forming or affording a shade; shady; shaded; as,\n   umbrageous trees or foliage.'),('Umbrageous','a.','Not easily perceived, as if from being darkened or\n   shaded; obscure.'),('Umbrageous','a.','Feeling jealousy or umbrage; taking, or disposed to\n   take, umbrage; suspicious.'),('Umbrate','v. t.','To shade; to shadow; to foreshadow.'),('Umbratic','a.','Alt. of Umbratical'),('Umbratical','a.','Of or pertaining to the shade or darkness; shadowy;\n   unreal; secluded; retired.'),('Umbratile','a.','Umbratic.'),('Umbratious','a.','Suspicious; captious; disposed to take umbrage.'),('Umbre','n.','See Umber.'),('Umbrel','n.','An umbrella.'),('Umbrella','n.','A shade, screen, or guard, carried in the hand for\n   sheltering the person from the rays of the sun, or from rain or snow.\n   It is formed of silk, cotton, or other fabric, extended on strips of\n   whalebone, steel, or other elastic material, inserted, or fastened to,\n   a rod or stick by means of pivots or hinges, in such a way as to allow\n   of being opened and closed with ease. See Parasol.'),('Umbrella','n.','The umbrellalike disk, or swimming bell, of a jellyfish.'),('Umbrella','n.','Any marine tectibranchiate gastropod of the genus\n   Umbrella, having an umbrella-shaped shell; -- called also umbrella\n   shell.'),('Umbrere','n.','Alt. of Umbriere'),('Umbriere','n.','In ancient armor, a visor, or projection like the peak of\n   a cap, to which a face guard was sometimes attached. This was sometimes\n   fixed, and sometimes moved freely upon the helmet and could be raised\n   like the beaver. Called also umber, and umbril.'),('Umbrette','n.','See Umber, 4.'),('Umbriferous','a.','Casting or making a shade; umbrageous.'),('Umbril','n.','A umbrere.'),('Umbrine','n.','See Umbra, 2.'),('Umbrose','a.','Shady; umbrageous.'),('Umbrosity','n.','The quality or state of being umbrose; shadiness.'),('Umhofo','n.','An African two-horned rhinoceros (Atelodus, / Rhinoceros,\n   simus); -- called also chukuru, and white rhinoceros.'),('Umlaut','n.','The euphonic modification of a root vowel sound by the\n   influence of a, u, or especially i, in the syllable which formerly\n   followed.'),('Umlauted','a.','Having the umlaut; as, umlauted vowels.'),('Umpirage','n.','The office of an umpire; the power, right, or authority\n   of an umpire to decide.'),('Umpirage','n.','The act of umpiring; arbitrament.'),('Umpire','n.','A person to whose sole decision a controversy or question\n   between parties is referred; especially, one chosen to see that the\n   rules of a game, as cricket, baseball, or the like, are strictly\n   observed.'),('Umpire','n.','A third person, who is to decide a controversy or question\n   submitted to arbitrators in case of their disagreement.'),('Umpired','imp. & p. p.','of Umpire'),('Umpiring','p. pr. & vb. n.','of Umpire'),('Umpire','v. t.','To decide as umpire; to arbitrate; to settle, as a\n   dispute.'),('Umpire','v. t.','To perform the duties of umpire in or for; as, to umpire\n   a game.'),('Umpire','v. i.','To act as umpire or arbitrator.'),('Umpireship','n.','Umpirage; arbitrament.'),('Umpress','n.','Female umpire.'),('Umquhile','adv.','Some time ago; formerly.'),('Umquhile','a.','Former.'),('Un-','','An inseparable verbal prefix or particle. It is prefixed: (a) To\n   verbs to express the contrary, and not the simple negative, of the\n   action of the verb to which it is prefixed; as in uncoil, undo, unfold.\n   (b) To nouns to form verbs expressing privation of the thing, quality,\n   or state expressed by the noun, or separation from it; as in unchild,\n   unsex. Sometimes particles and participial adjectives formed with this\n   prefix coincide in form with compounds of the negative prefix un- (see\n   2d Un-); as in undone (from undo), meaning unfastened, ruined; and\n   undone (from 2d un- and done) meaning not done, not finished. Un- is\n   sometimes used with an intensive force merely; as in unloose.'),('Un-','adv.','An inseparable prefix, or particle, signifying not; in-;\n   non-. In- is prefixed mostly to words of Latin origin, or else to words\n   formed by Latin suffixes; un- is of much wider application, and is\n   attached at will to almost any adjective, or participle used\n   adjectively, or adverb, from which it may be desired to form a\n   corresponding negative adjective or adverb, and is also, but less\n   freely, prefixed to nouns. Un- sometimes has merely an intensive force;\n   as in unmerciless, unremorseless.'),('Un-','adv.','Un- is prefixed to adjectives, or to words used adjectively.'),('Un-','adv.','To adjectives, to denote the absence of the quality\n   designated by the adjective'),('Un-','adv.','To past particles, or to adjectives formed after the analogy\n   of past particles, to indicate the absence of the condition or state\n   expressed by them'),('Un-','adv.','To present particles which come from intransitive verbs, or\n   are themselves employed as adjectives, to mark the absence of the\n   activity, disposition, or condition implied by the participle; as, -\n   ---- and the like.'),('Un-','adv.','Those which have acquired an opposed or contrary, instead of\n   a merely negative, meaning; as, unfriendly, ungraceful, unpalatable,\n   unquiet, and the like; or else an intensive sense more than a prefixed\n   not would express; as, unending, unparalleled, undisciplined,\n   undoubted, unsafe, and the like.'),('Un-','adv.','Those which have the value of independent words, inasmuch as\n   the simple words are either not used at all, or are rarely, or at least\n   much less frequently, used; as, unavoidable, unconscionable,\n   undeniable, unspeakable, unprecedented, unruly, and the like; or\n   inasmuch as they are used in a different sense from the usual meaning\n   of the primitive, or especially in one of the significations of the\n   latter; as, unaccountable, unalloyed, unbelieving, unpretending,\n   unreserved, and the like; or inasmuch as they are so frequently and\n   familiarly used that they are hardly felt to be of negative origin; as,\n   uncertain, uneven, and the like.'),('Un-','adv.','Those which are anomalous, provincial, or, for some other\n   reason, not desirable to be used, and are so indicated; as, unpure for\n   impure, unsatisfaction for dissatisfaction, unexpressible for\n   inexpressible, and the like.'),('Un-','adv.','Un- is prefixed to nouns to express the absence of, or the\n   contrary of, that which the noun signifies; as, unbelief, unfaith,\n   unhealth, unrest, untruth, and the like.'),('Unability','n.','Inability.'),('Unable','a.','Not able; not having sufficient strength, means, knowledge,\n   skill, or the like; impotent\' weak; helpless; incapable; -- now usually\n   followed by an infinitive or an adverbial phrase; as, unable for work;\n   unable to bear fatigue.'),('Unabled','a.','Disabled.'),('Unableness','n.','Inability.'),('Una boat','','The English name for a catboat; -- so called because Una\n   was the name of the first boat of this kind taken to England.'),('Unabridged','a.','Not abridged, or shortened; full; complete; entire;\n   whole.'),('Unabsorbable','a.','Not absorbable; specifically (Physiol.), not capable\n   of absorption; unable to pass by osmosis into the circulating blood;\n   as, the unabsorbable portion of food.'),('Unacceptability','n.','The quality of being unacceptable;\n   unacceptableness.'),('Unacceptable','a.','Not acceptable; not pleasing; not welcome;\n   unpleasant; disagreeable; displeasing; offensive.'),('Unaccessible','a.','Inaccessible.'),('Unaccomplished','a.','Not accomplished or performed; unfinished; also,\n   deficient in accomplishment; unrefined.'),('Unaccomplishment','n.','The state of being unaccomplished.'),('Unaccountability','n.','The quality or state of being unaccountable.'),('Unaccountable','a.','Not accountable or responsible; free from control.'),('Unaccountable','a.','Not to be accounted for; inexplicable; not consonant\n   with reason or rule; strange; mysterious.'),('Unaccurate','a.','Inaccurate.'),('Unaccurateness','n.','Inaccuracy.'),('Unaccustomed','a.','Not used; not habituated; unfamiliar; unused; --\n   which to.'),('Unaccustomed','a.','Not usual; uncommon; strange; new.'),('Unacquaintance','n.','The quality or state of being unacquainted; want of\n   acquaintance; ignorance.'),('Unacquainted','a.','Not acquainted.'),('Unacquainted','a.','Not usual; unfamiliar; strange.'),('Unacquaintedness','n.','Unacquaintance.'),('Unactive','a.','Inactive; listless.'),('Unactive','v. t.','To render inactive or listless.'),('Unactiveness','n.','Inactivity.'),('Unadmissible','a.','Alt. of Unadmittable'),('Unadmittable','a.','Inadmissible.'),('Unadulterate','a.','Alt. of Unadulterated'),('Unadulterated','a.','Not adulterated; pure.'),('Unadvisable','a.','Not advisable; inadvisable; inexpedient.'),('Unadvised','a.','Not prudent; not discreet; ill advised.'),('Unadvised','a.','Done without due consideration; wanton; rash;\n   inconsiderate; as, an unadvised proceeding.'),('Unaffected','a.','Not affected or moved; destitute of affection or\n   emotion; uninfluenced.'),('Unaffected','a.','Free from affectation; plain; simple; natural; real;\n   sincere; genuine; as, unaffected sorrow.'),('Unafiled','a.','Undefiled.'),('Unagreeable','a.','Disagreeable.'),('Unagreeable','a.','Not agreeing or consistent; unsuitable.'),('Unaidable','a.','Incapable of being aided.'),('Unalienable','a.','Inalienable; as, unalienable rights.'),('Unalist','n.','An ecclesiastical who holds but one benefice; --\n   distinguished from pluralist.'),('Unallied','a.','Not allied; having no ally; having no connection or\n   relation; as, unallied species or genera.'),('Unalloyed','a.','Not alloyed; not reduced by foreign admixture; unmixed;\n   unqualified; pure; as, unalloyed metals; unalloyed happiness.'),('Unalmsed','a.','Not having received alms.'),('Unambiguity','n.','Absence of ambiguity; clearness; perspicuity.'),('Unambition','n.','The absence of ambition.'),('Unamiability','n.','The quality or state of being unamiable; moroseness.'),('Unamiable','a.','Not amiable; morose; ill-natured; repulsive.'),('Unanchor','v. t.','To loose from the anchor, as a ship.'),('Unaneled','a.','Not aneled; not having received extreme unction.'),('Unanimate','a.','Unanimous.'),('Unanimity','n.','The quality or state of being unanimous.'),('Unanimous','a.','Being of one mind; agreeing in opinion, design, or\n   determination; consentient; not discordant or dissentient; harmonious;\n   as, the assembly was unanimous; the members of the council were\n   unanimous.'),('Unanimous','a.','Formed with unanimity; indicating unanimity; having the\n   agreement and consent of all; agreed upon without the opposition or\n   contradiction of any; as, a unanimous opinion; a unanimous vote.'),('Unanswerability','n.','The quality of being unanswerable;\n   unanswerableness.'),('Unanswerable','a.','Not answerable; irrefutable; conclusive; decisive;\n   as, he have an unanswerable argument.'),('Unanswered','a.','Not answered; not replied; as, an unanswered letter.'),('Unanswered','a.','Not refuted; as, an unanswered argument.'),('Unanswered','a.','Not responded to in kind; unrequited; as, unanswered\n   affection.'),('Unappalled','a.','Not appalled; not frightened; dauntless; undaunted.'),('Unapparel','v. t.','To divest of clothing; to strip.'),('Unappealable','a.','Not appealable; that can not be carried to a higher\n   tribunal by appeal; as, an unappealable suit or action.'),('Unappealable','a.','Not to be appealed from; -- said of a judge or a\n   judgment that can not be overruled.'),('Unappliable','a.','Inapplicable.'),('Unapplicable','a.','Inapplicable.'),('Unappropriate','a.','Inappropriate; unsuitable.'),('Unappropriate','a.','Not appropriated.'),('Unappropriate','v. t.','To take from private possession; to restore to\n   the possession or right of all; as, to unappropriate a monopoly.'),('Unappropriated','a.','Not specially appropriate; having not special\n   application.'),('Unappropriated','a.','Not granted to any person, corporation, or the\n   like, to the exclusion of others; as, unappropriated lands.'),('Unappropriated','a.','Not granted for, or applied to, any specific\n   purpose; as, the unappropriated moneys in the treasury.'),('Unapproved','a.','Not approved.'),('Unapproved','a.','Not proved.'),('Unapt','a.','Inapt; slow; dull.'),('Unapt','a.','Unsuitable; unfit; inappropriate.'),('Unapt','a.','Not accustomed and not likely; not disposed.'),('Unaquit','a.','Unrequited.'),('Unargued','a.','Not argued or debated.'),('Unargued','a.','Not argued against; undisputed.'),('Unargued','a.','Not censured.'),('Unarm','v. t.','To disarm.'),('Unarm','v. i.','To puff off, or lay down, one\'s arms or armor.'),('Unarmed','a.','Not armed or armored; having no arms or weapons.'),('Unarmed','a.','Having no hard and sharp projections, as spines, prickles,\n   spurs, claws, etc.'),('Unarted','a.','Ignorant of the arts.'),('Unarted','a.','Not artificial; plain; simple.'),('Unartful','a.','Lacking art or skill; artless.'),('Unartistic','a.','Inartistic.'),('Unascried','a.','Not descried.'),('Unaserved','a.','Not served.'),('Unassuming','a.','Not assuming; not bold or forward; not arrogant or\n   presuming; humble; modest; retiring; as, an unassuming youth;\n   unassuming manners.'),('Unassured','a.','Not assured; not bold or confident.'),('Unassured','a.','Not to be trusted.'),('Unassured','a.','Not insured against loss; as, unassured goods.'),('Unatonable','a.','Not capable of being brought into harmony;\n   irreconcilable.'),('Unatonable','a.','Incapable of being atoned for; inexpiable.'),('Unattached','a.','Not attached; not adhering; having no engagement; free.'),('Unattached','a.','Not assigned to any company or regiment.'),('Unattached','a.','Not taken or arrested.'),('Unattentive','a.','Inattentive; careless.'),('Unattire','v. t.','To divest of attire; to undress.'),('Unau','n.','The two-toed sloth (Cholopus didactylus), native of South\n   America. It is about two feet long. Its color is a uniform grayish\n   brown, sometimes with a reddish tint.'),('Unaudienced','a.','Not given an audience; not received or heard.'),('Unauspicious','a.','Inauspicious.'),('Unauthorize','v. t.','To disown the authority of; to repudiate.'),('Unavoidable','a.','Not avoidable; incapable of being shunned or\n   prevented; inevitable; necessary; as, unavoidable troubles.'),('Unavoidable','a.','Not voidable; incapable of being made null or void.'),('Unavoided','a.','Not avoided or shunned.'),('Unavoided','a.','Unavoidable; inevitable.'),('Unaware','a.','Not aware; not noticing; giving no heed; thoughtless;\n   inattentive.'),('Unaware','adv.','Unawares.'),('Unawares','adv.','Without design or preparation; suddenly; without\n   premeditation, unexpectedly.'),('Unbacked','a.','Never mounted by a rider; unbroken.'),('Unbacked','a.','Not supported or encouraged; not countenanced; unaided.'),('Unbag','v. t.','To pour, or take, or let go, out of a bag or bags.'),('Unbalanced','a.','Not balanced; not in equipoise; having no counterpoise,\n   or having insufficient counterpoise.'),('Unbalanced','a.','Not adjusted; not settled; not brought to an equality\n   of debt and credit; as, an unbalanced account; unbalanced books.'),('Unbalanced','a.','Being, or being thrown, out of equilibrium; hence,\n   disordered or deranged in sense; unsteady; unsound; as, an unbalanced\n   mind.'),('Unballast','v. t.','To free from ballast; to discharge ballast from.'),('Unballast','a.','Not ballasted.'),('Unballasted','a.','Freed from ballast; having discharged ballast.'),('Unballasted','a.','Not furnished with ballast; not kept steady by\n   ballast; unsteady; as, unballasted vessels; unballasted wits.'),('Unbaned','a.','Wanting a band or string; unfastened.'),('Unbank','v. t.','To remove a bank from; to open by, or as if by, the\n   removal of a bank.'),('Unbar','v. t.','To remove a bar or bars from; to unbolt; to open; as, to\n   unbar a gate.'),('Unbarbed','a.','Not shaven.'),('Unbarbed','a.','Destitute of bards, or of reversed points, hairs, or\n   plumes; as, an unbarded feather.'),('Unbark','v. t.','To deprive of the bark; to decorticate; to strip; as, to\n   unbark a tree.'),('Unbark','v. t.','To cause to disembark; to land.'),('Unbarrel','v. t.','To remove or release from a barrel or barrels.'),('Unbarricade','v. t.','To unbolt; to unbar; to open.'),('Unbarricadoed','a.','Not obstructed by barricades; open; as,\n   unbarricadoed streets.'),('Unbashful','a.','Not bashful or modest; bold; impudent; shameless.'),('Unbay','v. t.','To free from the restraint of anything that surrounds or\n   incloses; to let loose; to open.'),('Unbe','v. t.','To cause not to be; to cause to be another.'),('Unbear','v. t.','To remove or loose the bearing rein of (a horse).'),('Unbeat','v. t.','To deliver from the form or nature of a beast.'),('Unbecome','v. t.','To misbecome.'),('Unbecoming','a.','Not becoming; unsuitable; unfit; indecorous; improper.'),('Unbed','v. t.','To raise or rouse from bed.'),('Unbedinned','a.','Not filled with din.'),('Unbefool','v. t.','To deliver from the state of a fool; to awaken the\n   mind of; to undeceive.'),('Unbeget','v. t.','To deprive of existence.'),('Unbegilt','a.','Not gilded; hence, not rewarded with gold.'),('U