ase to be bent; to become straight or relaxed.'),('Unbend','v. i.','To relax in exertion, attention, severity, or the like;\n   hence, to indulge in mirth or amusement.'),('Unbending','a.','Not bending; not suffering flexure; not yielding to\n   pressure; stiff; -- applied to material things.'),('Unbending','a.','Unyielding in will; not subject to persuasion or\n   influence; inflexible; resolute; -- applied to persons.'),('Unbending','a.','Unyielding in nature; unchangeable; fixed; -- applied to\n   abstract ideas; as, unbending truths.'),('Unbending','a.','Devoted to relaxation or amusement.'),('Unbenevolence','n.','Absence or want of benevolence; ill will.'),('Unbenign','a.','Not benign; malignant.'),('Unbenumb','v. t.','To relieve of numbness; to restore sensation to.'),('Unbereaven','a.','Unbereft.'),('Unbereft','a.','Not bereft; not taken away.'),('Unbeseem','v. t.','To be unbecoming or unsuitable to; to misbecome.'),('Unbeseeming','a.','Unbecoming; not befitting.'),('Unbespeak','v. t.','To unsay; hence, to annul or cancel.'),('Unbethink','v. t.','To change the mind of (one\'s self).'),('Unbeware','adv.','Unawares.'),('Unbewitch','v. t.','To free from a spell; to disenchant.'),('Unbias','v. t.','To free from bias or prejudice.'),('Unbiased','a.','Free from bias or prejudice; unprejudiced; impartial.'),('Unbid','a.','Alt. of Unbidden'),('Unbidden','a.','Not bidden; not commanded.'),('Unbidden','a.','Uninvited; as, unbidden guests.'),('Unbidden','a.','Being without a prayer.'),('Unbound','imp. & p. p.','of Unbind'),('Unbinding','p. pr. & vb. n.','of Unbind'),('Unbind','v. t.','To remove a band from; to set free from shackles or\n   fastenings; to unite; to unfasten; to loose; as, unbind your fillets;\n   to unbind a prisoner\'s arms; to unbind a load.'),('Unbishop','v. t.','To deprive, as a city, of a bishop; to deprive, as a\n   clergyman, of episcopal dignity or rights.'),('Unbitted','imp. & p. p.','of Unbit'),('Unbitting','p. pr. & vb. n.','of Unbit'),('Unbit