y at less than the real value or worth; to buy\n   cheaper than.'),('Undercast','v. t.','To cast under or beneath.'),('Underchamberlain','n.','A deputy chamberlain of the exchequer.'),('Underchanter','n.','Same as Subchanter.'),('Underchaps','n. pl.','The lower chaps or jaw.'),('Undercharge','v. t.','To charge below or under; to charge less than is\n   usual or suitable fro; as, to undercharge goods or services.'),('Undercharge','v. t.','To put too small a charge into; as, to undercharge\n   a gun.'),('Undercharge','n.','A charge that is less than is usual or suitable.'),('Underclay','n.','A stratum of clay lying beneath a coal bed, often\n   containing the roots of coal plants, especially the Stigmaria.'),('Undercliff','n.','A subordinate cliff on a shore, consisting of material\n   that has fallen from the higher cliff above.'),('Underclothes','n. pl.','Clothes worn under others, especially those worn\n   next the skin for warmth.'),('Underclothing','n.','Same as Underclothes.'),('Undercoat','n.','A coat worn under another; a light coat, as\n   distinguished from an overcoat, or a greatcoat.'),('Undercoat','n.','A growth of short hair or fur partially concealed by a\n   longer growth; as, a dog\'s undercoat.'),('Underconduct','n.','A lower conduit; a subterranean conduit.'),('Underconsumption','n.','Consumption of less than is produced; consumption\n   of less than the usual amount.'),('Undercraft','n.','A sly trick or device; as, an undercraft of authors.'),('Undercreep','v. i.','To creep secretly or privily.'),('Undercrest','v. t.','To support as a crest; to bear.'),('Undercroft','n.','A subterranean room of any kind; esp., one under a\n   church (see Crypt), or one used as a chapel or for any sacred purpose.'),('Undercry','v. i.','To cry aloud.'),('Undercurrent','n.','A current below the surface of water, sometimes\n   flowing in a contrary direction to that on the surface.'),('Undercurrent','n.','Hence, figuratively, a tendency of feeling, opinion,\n   or the 