icle\n   of dress.'),('Undergraduate','n.','A member of a university or a college who has not\n   taken his first degree; a student in any school who has not completed\n   his course.'),('Undergraduate','a.','Of or pertaining to an undergraduate, or the body of\n   undergraduates.'),('Undergraduateship','n.','The position or condition of an undergraduate.'),('Undergroan','v. t.','To groan beneath.'),('Underground','n.','The place or space beneath the surface of the ground;\n   subterranean space.'),('Underground','a.','Being below the surface of the ground; as, an\n   underground story or apartment.'),('Underground','a.','Done or occurring out of sight; secret.'),('Underground','adv.','Beneath the surface of the earth.'),('Undergrove','n.','A grove of shrubs or low trees under taller ones.'),('Undergrow','v. i.','To grow to an inferior, or less than the usual, size\n   or height.'),('Undergrow','a.','Undergrown.'),('Undergrown','a.','Of small stature; not grown to a full height or size.'),('Undergrowth','n.','That which grows under trees; specifically, shrubs or\n   small trees growing among large trees.'),('Undergrub','v. t.','To undermine.'),('Underhand','a.','Secret; clandestine; hence, mean; unfair; fraudulent.'),('Underhand','a.','Done, as pitching, with the hand lower than the\n   shoulder, or, as bowling, with the hand lower than elbow.'),('Underhand','adv.','By secret means; in a clandestine manner; hence, by\n   fraud; unfairly.'),('Underhand','adv.','In an underhand manner; -- said of pitching or\n   bowling.'),('Underhanded','a.','Underhand; clandestine.'),('Underhanded','a.','Insufficiently provided with hands or workers;\n   short-handed; sparsely populated.'),('Underhandedly','adv.','In an underhand manner.'),('Underhang','v. t. & i.','To hang under or down; to suspend.'),('Underhangman','n.','An assistant or deputy hangman.'),('Underhead','n.','A blockhead, or stupid person; a dunderhead.'),('Underheave','v. i.','To heave or lift from below.'),('Under