ps.'),('Undust','v. t.','To free from dust.'),('Undwellable','a.','Uninhabitable.'),('Undwelt','a.','Not lived (in); -- with in.'),('Undying','a.','Not dying; imperishable; unending; immortal; as, the\n   undying souls of men.'),('Uneared','a.','Not eared, or plowed.'),('Unearned','a.','Not earned; not gained by labor or service.'),('Unearthed','imp. & p. p.','of Unearth'),('Unearthing','p. pr. & vb. n.','of Unearth'),('Unearth','v. t.','To drive or draw from the earth; hence, to uncover; to\n   bring out from concealment; to bring to light; to disclose; as, to\n   unearth a secret.'),('Unearthly','a.','Not terrestrial; supernatural; preternatural; hence,\n   weird; appalling; terrific; as, an unearthly sight or sound.'),('Unease','n.','Want of ease; uneasiness.'),('Uneasity','adv.','In an easy manner.'),('Uneasiness','n.','The quality or state of being uneasy; restlessness;\n   disquietude; anxiety.'),('Uneasiness','n.','The quality of making uneasy; discomfort; as, the\n   uneasiness of the road.'),('Uneasy','a.','Not easy; difficult.'),('Uneasy','a.','Restless; disturbed by pain, anxiety, or the like;\n   disquieted; perturbed.'),('Uneasy','a.','Not easy in manner; constrained; stiff; awkward; not\n   graceful; as, an uneasy deportment.'),('Uneasy','a.','Occasioning want of ease; constraining; cramping;\n   disagreeable; unpleasing.'),('Uneath','a.','Not easy; difficult; hard.'),('Uneath','adv.','Not easily; hardly; scarcely.'),('Unedge','v. t.','To deprive of the edge; to blunt.'),('Unefectual','a.','Ineffectual.'),('Unelastic','a.','Not elastic; inelastic.'),('Unelasticity','n.','Inelasticity.'),('Unelegant','a.','Inelegant.'),('Uneligible','a.','Ineligible.'),('Unembarrassed','a.','Not embarrassed.'),('Unembarrassed','a.','Not perplexed in mind; not confused; as, the speaker\n   appeared unembarrassed.'),('Unembarrassed','a.','Free from pecuniary difficulties or encumbrances;\n   as, he and his property are unembarrassed.'),('Unembarrassed','a.','Free from perplexing connection; as, the question\n   comes into court unembarrassed with irrelevant matter.'),('Unembarrassment','n.','Freedom from embarrassment.'),('Unembodied','a.','Free from a corporeal body; disembodied; as, unembodied\n   spirits.'),('Unembodied','a.','Not embodied; not collected into a body; not yet\n   organized; as, unembodied militia.'),('Unempirically','adv.','Not empirically; without experiment or experience.'),('Unemployed','a.','Not employed in manual or other labor; having no\n   regular work.'),('Unemployed','a.','Not invested or used; as, unemployed capital.'),('Unencumber','v. t.','To free from incumbrance; to disencumber.'),('Unendly','a.','Unending; endless.'),('Unentangle','v. t.','To disentangle.'),('Unequal','a.','Not equal; not matched; not of the same size, length,\n   breadth, quantity, strength, talents, acquirements, age, station, or\n   the like; as, the fingers are of unequal length; peers and commoners\n   are unequal in rank.'),('Unequal','a.','Ill balanced or matched; disproportioned; hence, not\n   equitable; partial; unjust; unfair.'),('Unequal','a.','Not uniform; not equable; irregular; uneven; as, unequal\n   pulsations; an unequal poem.'),('Unequal','a.','Not adequate or sufficient; inferior; as, the man was\n   unequal to the emergency; the timber was unequal to the sudden strain.'),('Unequal','a.','Not having the two sides or the parts symmetrical.'),('Unequalable','a.','Not capable of being equaled or paralleled.'),('Unequaled','a.','Not equaled; unmatched; unparalleled; unrivaled;\n   exceeding; surpassing; -- in a good or bad sense; as, unequaled\n   excellence; unequaled ingratitude or baseness.'),('Unequally','adv.','In an unequal manner.'),('Unequalness','n.','The quality or state of being unequal; inequality;\n   unevenness.'),('Unequitable','a.','Inequitable.'),('Unequity','n.','Want of equity or uprightness; injustice; wickedness;\n   iniquity.'),('Unequivocal','a.','Not equivocal; not doubtful; not ambiguous; ev