d.'),('Unheard','a.','Not known to fame; not illustrious or celebrated; obscure.'),('Unheard-of','a.','New; unprecedented; unparalleled.'),('Unheart','v. t.','To cause to lose heart; to dishearten.'),('Unheedy','a.','Incautious; precipitate; heedless.'),('Unheired','a.','Destitute of an heir.'),('Unhele','n.','Same as Unheal, n.'),('Unhele','v. t.','To uncover.'),('Unhelm','v. t.','To deprive of the helm or helmet.'),('Unhelmed','a.','Divested or deprived of the helm or helmet.'),('Unhelmed','a.','Not wearing a helmet; without a helmet.'),('Unhelmet','v. t.','To deprive of the helmet.'),('Unhide','v. t.','To bring out from concealment; to discover.'),('Unhinge','v. t.','To take from the hinges; as, to unhinge a door.'),('Unhinge','v. t.','To displace; to unfix by violence.'),('Unhinge','v. t.','To render unstable or wavering; to unsettle; as, to\n   unhinge one\'s mind or opinions; to unhinge the nerves.'),('Unhingement','n.','The act unhinging, or the state of being unhinged.'),('Unhitch','v. t.','To free from being hitched, or as if from being\n   hitched; to unfasten; to loose; as, to unhitch a horse, or a trace.'),('Unhive','v. t. v. t.','To drive or remove from a hive.'),('Unhive','v. t. v. t.','To deprive of habitation or shelter, as a crowd.'),('Unhoard','v. t.','To take or steal from a hoard; to pilfer.'),('Unhold','v. t.','To cease to hold; to unhand; to release.'),('Unholy','a.','Not holy; unhallowed; not consecrated; hence, profane;\n   wicked; impious.'),('Unhonest','a.','Dishonest; dishonorable.'),('Unhood','v. t.','To remove a hood or disguise from.'),('Unhook','v. t.','To loose from a hook; to undo or open by loosening or\n   unfastening the hooks of; as, to unhook a fish; to unhook a dress.'),('Unhoop','v. t.','To strip or deprive of hoops; to take away the hoops of.'),('Unhoped','a.','Not hoped or expected.'),('Unhoped-for','a.','Unhoped; unexpected.'),('Unhorse','v. t.','To throw from a horse; to cause to dismount; also, to\n   take a horse or horses from; as, to unhorse a rider; to unhorse a\n   carriage.'),('Unhosed','a.','Without hose.'),('Unhospitable','a.','Inhospitable.'),('Unhouse','v. t.','To drive from a house or habitation; to dislodge;\n   hence, to deprive of shelter.'),('Unhoused','a.','Driven from a house; deprived of shelter.'),('Unhoused','a.','Not provided with a house or shelter; houseless;\n   homeless.'),('Unhouseled','a.','Not having received the sacrament.'),('Unhuman','a.','Not human; inhuman.'),('Unhumanize','v. t.','To render inhuman or barbarous.'),('Unhusked','a.','Not husked; having the husk on.'),('Unhusked','a.','Having the husk removed; without husk.'),('Uni-','','A prefix signifying one, once; as in uniaxial, unicellular.'),('Uniat','n.','Alt. of Uniate'),('Uniate','n.','A member of the Greek Church, who nevertheless acknowledges\n   the supremacy of the Pope of Rome; one of the United Greeks. Also used\n   adjectively.'),('Uniaxal','a.','Uniaxial.'),('Uniaxial','a.','Having but one optic axis, or line of no double\n   refraction.'),('Uniaxial','a.','Having only one axis; developing along a single line or\n   plane; -- opposed to multiaxial.'),('Uniaxially','adv.','In a uniaxial manner.'),('Unibranchiate','a.','Having but one gill, as certain molluscs.'),('Unicameral','a.','Having, or consisting of, a single chamber; -- said of\n   a legislative assembly.'),('Unicapsular','','Having but one capsule to each flower.'),('Unicarinated','a.','Having one ridge or keel.'),('Unicelled','a.','Unicellular.'),('Unicellular','a.','Having, or consisting of, but a single cell; as, a\n   unicellular organism.'),('Unicentral','a.','Having a single center of growth.'),('Unicity','n.','The condition of being united; quality of the unique;\n   unification.'),('Uniclinal','a.','See Nonoclinal.'),('Unicolorous','a.','Having the surface of a uniform color.'),('Unicorn','n.','A fabulous animal with one horn; the monoceros; -- often\n   represented in heraldry as a supporter.'),('Unicorn','n.','A two-horned animal of some unknown kind, so called in the\n   Authorized Version of the Scriptures.'),('Unicorn','n.','Any large beetle having a hornlike prominence on the head\n   or prothorax.'),('Unicorn','n.','The larva of a unicorn moth.'),('Unicorn','n.','The kamichi; -- called also unicorn bird.'),('Unicorn','n.','A howitzer.'),('Unicornous','a.','Having but a single horn; -- said of certain insects.'),('Unicostate','a.','Having a single rib or strong nerve running upward from\n   the base; -- said of a leaf.'),('Unicursal','a.','That can be passed over in a single course; -- said of a\n   curve when the coordinates of the point on the curve can be expressed\n   as rational algebraic functions of a single parameter /.'),('Unideaed','a.','Having no ideas; senseless; frivolous.'),('Unideal','a.','Not ideal; real; unimaginative.'),('Unideal','a.','Unideaed.'),('Unidimensional','a.','Having but one dimension. See Dimension.'),('Unifacial','a.','Having but one front surface; as, some foliaceous corals\n   are unifacial, the polyp mouths being confined to one surface.'),('Unific','a.','Making one or unity; unifying.'),('Unification','n.','The act of unifying, or the state of being unified.'),('Unifier','n.','One who, or that which, unifies; as, a natural law is a\n   unifier of phenomena.'),('Unifilar','a.','Having only one thread; involving the use of only one\n   thread, wire, fiber, or the like; as, unifilar suspension.'),('Uniflagellate','a.','Having but one flagellum; as, uniflagellate\n   organisms.'),('Uniflorous','a.','Bearing one flower only; as, a uniflorous peduncle.'),('Unifolliate','a.','Having only one leaf.'),('Unifollilate','a.','Having only one leaflet, as the leaves of the orange\n   tree.'),('Uniform','a.','Having always the same form, manner, or degree; not\n   varying or variable; unchanging; consistent; equable; homogenous; as,\n   the dress of the Asiatics has been uniform from early ages; the\n   temperature is uniform; a stratum of uniform clay.'),('Uniform','a.','Of the same form with others; agreeing with each other;\n   conforming to one rule or mode; consonant.'),('Uniform','a.','A dress of a particular style or fashion worn by persons\n   in the same service or order by means of which they have a distinctive\n   appearance; as, the uniform of the artillery, of the police, of the\n   Freemasons, etc.'),('Uniform','v. t.','To clothe with a uniform; as, to uniform a company of\n   soldiers.'),('Uniform','v. t.','To make conformable.'),('Uniformal','a.','Uniform.'),('Uniformism','n.','The doctrine of uniformity in the geological history of\n   the earth; -- in part equivalent to uniformitarianism, but also used,\n   more broadly, as opposed to catastrophism.'),('Uniformitarian','a.','Of, pertaining to, or designating, the view or\n   doctrine that existing causes, acting in the same manner and with\n   essentially the same intensity as at the present time, are sufficient\n   to account for all geological changes.'),('Uniformitarian','n.','One who accepts uniformitarianism, or the\n   uniformitarian doctrine.'),('Uniformitarianism','n.','The uniformitarian doctrine.'),('Uniformity','n.','The quality or state of being uniform; freedom from\n   variation or difference; resemblance to itself at all times; sameness\n   of action, effect, etc., under like conditions; even tenor; as, the\n   uniformity of design in a poem; the uniformity of nature.'),('Uniformity','n.','Consistency; sameness; as, the uniformity of a man\'s\n   opinions.'),('Uniformity','n.','Similitude between the parts of a whole; as, the\n   uniformity of sides in a regular figure; beauty is said to consist in\n   uniformity with variety.'),('Uniformity','n.','Continued or unvaried sameness or likeness.'),('Uniformity','n.','Conformity to a pattern or rule; resemblance,\n   consonance, or agreement; as, the uniformity of different churches in\n   ceremonies or rites.'),('Uniformly','adv.','In a uniform manner; without variation or diversity;\n   by a regular, constant, or common ratio of change; with even tenor; as,\n   a temper uniformly mild.'),('Unifromness','n.','The quality or state of being uniform; uniformity.'),('Unified','imp. & p. p.','of Unify'),('Unifying','p. pr. & vb. n.','of Unify'),('Unify','v. t.','To cause to be one; to make into a unit; to unite; to\n   view as one.'),('Unigeniture','n.','The state of being the only begotten.'),('Unigenous','a.','Being of one kind; being of the same genus.'),('Unijugate','a.','Having but one pair of leaflets; -- said of a pinnate\n   leaf.'),('Unilabiate','a.','Having one lip only; as, a unilabiate corolla.'),('Unilateral','a.','Being on one side only; affecting but one side;\n   one-sided.'),('Unilateral','a.','Pertaining to one side; one-sided; as, a unilateral\n   raceme, in which the flowers grow only on one side of a common axis, or\n   are all turned to one side.'),('Uniliteral','a.','Consisting of one letter only; as, a uniliteral word or\n   sign.'),('Unilobar','a.','Consisting of a single lobe.'),('Unilocular','a.','Having one cell or cavity only; as, a unilocular\n   capsule or shell.'),('Unimitable','a.','Inimitable.'),('Unimpairable','a.','That can not be impaired.'),('Unimpeachable','a.','Not impeachable; not to be called in question;\n   exempt from liability to accusation; free from stain, guilt, or fault;\n   irreproachable; blameless; as, an unimpeachable reputation;\n   unimpeachable testimony.'),('Unimplicate','a.','Not implicated.'),('Unimportance','n.','Want of importance; triviality.'),('Unimproved','a.','Not improved; not made better or wiser; not advanced in\n   knowledge, manners, or excellence.'),('Unimproved','a.','Not used; not employed; especially, not used or\n   employed for a valuable purpose; as, unimproved opportunities;\n   unimproved blessings.'),('Unimproved','a.','Not tilled, cultivated, or built upon; yielding no\n   revenue; as, unimproved land or soil.'),('Unimuscular','a.','Having only one adductor muscle, and 