overing the whole field; sometimes, as in the flag of the United\n   States, and the English naval and marine flag, occupying the upper\n   inner corner, the rest of the flag being called the fly. Also, a flag\n   having such a device; especially, the flag of Great Britain.'),('Union','n.','A joint or other connection uniting parts of machinery, or\n   the like, as the elastic pipe of a tender connecting it with the feed\n   pipe of a locomotive engine; especially, a pipe fitting for connecting\n   pipes, or pipes and fittings, in such a way as to facilitate\n   disconnection.'),('Union','n.','A cask suspended on trunnions, in which fermentation is\n   carried on.'),('Unionism','n.','The sentiment of attachment to a federal union,\n   especially to the federal union of the United States.'),('Unionism','n.','The principles, or the system, of combination among\n   workmen engaged in the same occupation or trade.'),('Unionist','n.','One who advocates or promotes union; especially a loyal\n   supporter of a federal union, as that of the United States.'),('Unionist','n.','A member or supporter of a trades union.'),('Unionistic','a.','Of or pertaining to union or unionists; tending to\n   promote or preserve union.'),('Uniovulate','a.','Containing but one ovule.'),('Unipara','n.','A woman who has borne one child.'),('Uniparous','a.','Producing but one egg or young at a time.'),('Uniparous','a.','Producing but one axis of inflorescence; -- said of the\n   scorpioid cyme.'),('Uniped','a.','Having only one foot.'),('Unipersonal','a.','Existing as one, and only one, person; as, a\n   unipersonal God.'),('Unipersonal','a.','Used in only one person, especially only in the third\n   person, as some verbs; impersonal.'),('Unipersonalist','n.','One who believes that the Deity is unipersonal.'),('Uniphonous','a.','Having but one sound, as the drum.'),('Uniplicate','a.','Having, or consisting of, but one fold.'),('Unipolar','a.','Having, or acting by means of, one pole only.'),('Uni