e, as by adhesion or mixture; to coalesce; to grow together.'),('Unite','v. i.','To join in an act; to concur; to act in concert; as, all\n   parties united in signing the petition.'),('Unite','v. t.','United; joint; as, unite consent.'),('United','a.','Combined; joined; made one.'),('Unitedly','adv.','In an united manner.'),('Uniter','n.','One who, or that which, unites.'),('Uniterable','a.','Not iterable; incapable of being repeated.'),('Unition','v. t.','The act of uniting, or the state of being united;\n   junction.'),('Unitive','a.','Having the power of uniting; causing, or tending to\n   produce, union.'),('Unitively','adv.','In a unitive manner.'),('Unitized','imp. & p. p.','of Unitize'),('Unitizing','p. pr. & vb. n.','of Unitize'),('Unitize','v. t.','To reduce to a unit, or one whole; to form into a unit;\n   to unify.'),('Unitude','n.','Unity.'),('Unities','pl. ','of Unity'),('Unity','n.','The state of being one; oneness.'),('Unity','n.','Concord; harmony; conjunction; agreement; uniformity; as, a\n   unity of proofs; unity of doctrine.'),('Unity','n.','Any definite quantity, or aggregate of quantities or\n   magnitudes taken as one, or for which 1 is made to stand in\n   calculation; thus, in a table of natural sines, the radius of the\n   circle is regarded as unity.'),('Unity','n.','In dramatic composition, one of the principles by which a\n   uniform tenor of story and propriety of representation are preserved;\n   conformity in a composition to these; in oratory, discourse, etc., the\n   due subordination and reference of every part to the development of the\n   leading idea or the eastablishment of the main proposition.'),('Unity','n.','Such a combination of parts as to constitute a whole, or a\n   kind of symmetry of style and character.'),('Unity','n.','The peculiar characteristics of an estate held by several in\n   joint tenancy.'),('Univalence','n.','The quality or state of being univalent.'),('Univalent','a.','Having a valence of one; capable of