sitions.'),('Universalist','a.','Of or pertaining to Unversalists of their doctrines.'),('Universalistic','a.','Of or pertaining to the whole; universal.'),('Universalties','pl. ','of Universality'),('Universality','n.','The quality or state of being universal; unlimited\n   extension or application; generality; -- distinguished from\n   particularity; as, the unversality of a proposition; the unversality of\n   sin; the unversality of the Deluge.'),('Universalized','imp. & p. p.','of Universalize'),('Universalizing','p. pr. & vb. n.','of Universalize'),('Universalize','v. t.','To make universal; to generalize.'),('Universally','adv.','In a universal manner; without exception; as, God\'s\n   laws are universally binding on his creatures.'),('Universalness','n.','The quality or state of being universal;\n   universality.'),('Universe','n.','All created things viewed as constituting one system or\n   whole; the whole body of things, or of phenomena; the / / of the\n   Greeks, the mundus of the Latins; the world; creation.'),('Universities','pl. ','of University'),('University','n.','The universe; the whole.'),('University','n.','An association, society, guild, or corporation, esp.\n   one capable of having and acquiring property.'),('University','n.','An institution organized and incorporated for the\n   purpose of imparting instruction, examining students, and otherwise\n   promoting education in the higher branches of literature, science, art,\n   etc., empowered to confer degrees in the several arts and faculties, as\n   in theology, law, medicine, music, etc. A university may exist without\n   having any college connected with it, or it may consist of but one\n   college, or it may comprise an assemblage of colleges established in\n   any place, with professors for instructing students in the sciences and\n   other branches of learning.'),('Universological','a.','Of or pertaining to universology.'),('Universologist','n.','One who is versed in universology.'),('Uni